	ELSE
		
		  VALUES (OLD.id, CONCAT_WS(' ','<br />','LOAN TYPE NAME :',  `get_loan_type`( OLD.loan_type_id ),
				'<br />','AMOUNT :', old.amount,
				'<br />','MONTHS TO PAY :', old.months_to_pay,
				'<br />','START DATE :', old.start_date,
				'<br />','END DATE :', old.end_date), 
				
			CONCAT_WS(' ','<br />','LOAN TYPE NAME :', `get_loan_type`( new.loan_type_id ),
				'<br />','AMOUNT :', new.amount,
				'<br />','MONTHS TO PAY :', new.months_to_pay,
				'<br />','START DATE :', new.start_date,
				'<br />','END DATE :', new.end_date) , 'UPDATE', NEW.update_by);
	end if;
	
	
    END */$$


