/*!50003 CREATE */ /*!50017 DEFINER = 'root'@'localhost' */ /*!50003 TRIGGER `pos_update_price` AFTER UPDATE ON `pos_table_items` FOR EACH ROW BEGIN
    
     IF old.sales_price <> new.sales_price THEN
		pos_table_items_log 
		(
		date_created
		,detailed_action
		,ACTION
		,item_name
		,price_from
