		)
	VALUES
		(
		CURDATE()
		,CONCAT('Update Sales Price : ' ,new.item_name,'  From: ', old.sales_price, ' To ', new.sales_price) 
		,'Update Sales Price'
		,new.item_name
		,old.sales_price
		,new.sales_price
		);
	END IF;
	
	    IF old.cost_price <> new.cost_price THEN
		pos_table_items_log 
		(
		date_created
		,detailed_action
		,ACTION
		,item_name
		,price_from
		,price_to
		)
	VALUES
		(
		CURDATE()
		,CONCAT('Update Cost Price: ' ,new.item_name,'  From: ', old.cost_price, ' To ', new.cost_price) 
		,'Update Cost Price'
		,new.item_name
		,old.cost_price
		,new.cost_price
		);
	END IF;
	
    END */$$


