/* Trigger structure for table `pos_table_transaction` */

DELIMITER $$

/*!50003 DROP TRIGGER*//*!50032 IF EXISTS */ /*!50003 `tr_pos_update_items` */$$

/*!50003 CREATE */ /*!50017 DEFINER = 'root'@'localhost' */ /*!50003 TRIGGER `tr_pos_update_items` AFTER INSERT ON `pos_table_transaction` FOR EACH ROW 
    
    BEGIN
	DECLARE items INT;
	DECLARE meals INT;
	SET meals = (SELECT meal_qty FROM pos_table_mealoftheday WHERE meal_status = 'Serve' AND meal_name = new.item_name);
	SET items = (SELECT quantity FROM pos_table_items WHERE item_status = 'Active' AND item_name = new.item_name);
	
	UPDATE
		pos_table_items
	SET
		quantity = (items - new.quantity)
	WHERE
		item_status = 'Active' 
		AND
		item_name = new.item_name;
	UPDATE
		pos_table_mealoftheday
	SET
		meal_qty = (meals - new.quantity)
	WHERE
		meal_status = 'Serve'
		and
		meal_name = new.item_name;
    END */$$


DELIMITER ;

