/* Event structure for event `eve_create_date_range` */

/*!50106 DROP EVENT IF EXISTS `eve_create_date_range`*/;

DELIMITER $$

/*!50106 CREATE DEFINER=`root`@`localhost` EVENT `eve_create_date_range` ON SCHEDULE EVERY 24 HOUR STARTS '2019-10-15 17:23:00' ON COMPLETION NOT PRESERVE ENABLE DO BEGIN
	   DECLARE date_from DATE;
	   DECLARE date_to DATE;
	   SET date_from = (SELECT COUNT(*) FROM ess_db.tbl_temp_range_date WHERE gen_date = NOW());
	   SET date_to = ADDDATE(DATE_FORMAT(NOW(), "%Y-%m-%d"), INTERVAL 5 MONTH);
	   
	   IF date_from = 0 THEN
		SET date_from = '2019-10-01';
	   ELSE
		SET date_from = (SELECT gen_date FROM ess_db.tbl_temp_range_date ORDER BY gen_date DESC LIMIT 1);
 	   END IF;
 	   	
	   CALL ess_db.`sp_create_date_range`(date_from,date_to);
 END */$$
