/* Event structure for event `eve_update_leave_monthly` */

/*!50106 DROP EVENT IF EXISTS `eve_update_leave_monthly`*/;

DELIMITER $$

/*!50106 CREATE DEFINER=`root`@`localhost` EVENT `eve_update_leave_monthly` ON SCHEDULE EVERY 1 MONTH STARTS '2020-03-01 01:00:00' ON COMPLETION PRESERVE ENABLE DO BEGIN
		UPDATE
		     ess_db.tbl_user_availableleave AS dest,
		    (
			SELECT
			     *
			FROM
			     ess_db.`tbl_leavetypes`
			WHERE
			    leave_type_id = leave_type_id
			AND
			     w_reset_every ='monthly'
		    ) AS src
		SET
		    dest.leave_balance = src.leave_no_ofdays
		WHERE
		   dest.`leave_type_id` = src.leave_type_id;
	END */$$
