/* Event structure for event `eve_update_leave_yearly` */

/*!50106 DROP EVENT IF EXISTS `eve_update_leave_yearly`*/;

DELIMITER $$

/*!50106 CREATE DEFINER=`root`@`localhost` EVENT `eve_update_leave_yearly` ON SCHEDULE EVERY 1 YEAR STARTS '2021-01-01 00:00:00' ENDS '2038-01-01 00:00:00' ON COMPLETION NOT PRESERVE ENABLE DO BEGIN
		UPDATE
		     ess_db.tbl_user_availableleave AS dest,
		    (
			SELECT
			     *
			FROM
			     ess_db.`tbl_leavetypes`
			WHERE
			    leave_type_id = leave_type_id
			AND
			     w_reset_every ='yearly'
		    ) AS src
		SET
		    dest.leave_balance = src.leave_no_ofdays
		WHERE
