/* Function  structure for function  `func_count_boa` */

/*!50003 DROP FUNCTION IF EXISTS `func_count_boa` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `func_count_boa`(in_datestart date, in_dateend date, in_departmentid int) RETURNS int(11)
BEGIN
    
	declare totalcount int;
	declare countdb int;
	declare boa int;
	declare luffy int;
	declare concatdep varchar(50);
	
	if in_departmentid = 0 then 
		
		SET countdb = (SELECT COUNT(id)
		    FROM payroll_yeartodatefigures a
		    WHERE
			attendance_end BETWEEN in_datestart AND  in_dateend 
		);
	
	else 
		SET countdb = (SELECT COUNT(id)
		    FROM payroll_yeartodatefigures a
		    WHERE
			attendance_end BETWEEN in_datestart AND  in_dateend AND department_id = in_departmentid
		);
	END IF;
	
	set luffy = (SELECT SUBSTRING(countdb / 10 , 1, 1));
	set boa = (SELECT SUBSTRING(countdb / 10 , 3, 1));
       
       
	if boa != 0 then
		set totalcount =  luffy + 1;
	
	else 
		SET totalcount = boa;
	end if; 
        
        
   
	return totalcount;
    END */$$
DELIMITER ;

/* Function  structure for function  `func_Dateformat` */

