/* Function  structure for function  `func_new_late` */

/*!50003 DROP FUNCTION IF EXISTS `func_new_late` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `func_new_late`(inperhr DECIMAL(18,2) , inlate TIME) RETURNS decimal(18,2)
BEGIN
    
	DECLARE timedin  TIME;
	DECLARE perday DECIMAL(18,2);
	DECLARE calculatedperday DECIMAL(18,2);
	
	SET perday = inperhr * 8;
	IF inlate <= '00:05:00' THEN 
		SET calculatedperday = 0.00;
	ELSEIF inlate >= '00:06:00' AND  inlate <= '00:30:00' THEN
		SET calculatedperday =  perday - ( perday * 0.9375);
	ELSEIF inlate >= '00:30:00' AND  inlate <= '01:05:00' THEN
		SET calculatedperday =  perday - ( perday * 0.875);
	ELSEIF inlate >= '01:06:00' AND  inlate <= '01:30:00' THEN 
		SET calculatedperday =  perday - ( perday * 0.8125);
	ELSEIF inlate >= '01:30:00' AND  inlate <= '02:05:00' THEN
		SET calculatedperday =  perday - ( perday * 0.75);   
	ELSEIF inlate >= '02:06:00' AND  inlate <= '02:30:00' THEN
		SET calculatedperday =  perday - ( perday * 0.6875);		
	ELSEIF inlate >= '02:30:00' AND  inlate <= '03:05:00' THEN
		SET calculatedperday =  perday - ( perday * 0.625);
	ELSEIF inlate >= '03:06:00' AND  inlate <= '03:30:00' THEN
		SET calculatedperday =  perday - ( perday * 0.5625);	
	ELSEIF inlate >= '03:30:00' AND  inlate <= '04:05:00' THEN
		SET calculatedperday =  perday - ( perday * 0.5);	
	ELSEIF inlate >= '04:06:00' AND  inlate <= '04:30:00' THEN
		SET calculatedperday =  perday - ( perday * 0.4375);	
	ELSEIF inlate >= '04:30:00' AND  inlate <= '05:05:00' THEN
		SET calculatedperday =  perday - ( perday * 0.375);		
	ELSEIF inlate >= '05:06:00' AND  inlate <= '05:30:00' THEN
		SET calculatedperday =  perday - ( perday * 0.3125);	
	ELSEIF inlate >= '05:30:00' AND  inlate <= '06:05:00' THEN
		SET calculatedperday =  perday - ( perday * 0.25);	
	ELSEIF inlate >= '06:06:00' AND  inlate <= '06:30:00' THEN
		SET calculatedperday =  perday - ( perday * 0.1875);	
	ELSEIF inlate >= '06:30:00' AND  inlate <= '07:05:00' THEN
		SET calculatedperday =  perday - ( perday * 0.125);	
	
	
	ELSE SET calculatedperday = '0.00';
	
	END IF;
	
	RETURN calculatedperday;
    
    END */$$
DELIMITER ;

