/* Function  structure for function  `get_bt_out` */

/*!50003 DROP FUNCTION IF EXISTS `get_bt_out` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `get_bt_out`(bt_time TIME,bt_start DATETIME,bt_end DATETIME ,employee_id INT, deparment_id INT) RETURNS time
BEGIN 
	 DECLARE time_in DATETIME;
	 DECLARE time_out TIME;
	 
	 IF deparment_id = '7' THEN 
		 SET time_in = (SELECT 
					MAX(checktime)
				 FROM 
					adms_db.checkinout 
				 WHERE 
					userid = employee_id AND
					checktype NOT IN('2','3') AND
					checktime BETWEEN DATE_ADD(bt_end, INTERVAL -15 MINUTE) AND DATE_ADD(bt_end, INTERVAL 30 MINUTE) AND
					SN IN ('3569184260109','333')
				);
	ELSE
		 SET time_in = (SELECT 
					MAX(checktime)
				FROM 
					adms_db.checkinout 
				WHERE 
					userid = employee_id AND
					checktype NOT IN('2','3') AND
					checktime BETWEEN DATE_ADD(bt_end, INTERVAL -15 MINUTE) AND DATE_ADD(bt_end, INTERVAL 30 MINUTE)
				);
	END IF;
	IF time_in IS NULL THEN 
	   SET time_out = bt_time;
	ELSE
		   CASE
			WHEN time_in <= bt_end THEN
			     SET time_out = '00:00:00';
			ELSE
			     SET time_out = time_in;
		   end CASE;
	 END IF;
	RETURN time_out;
    END */$$
DELIMITER ;

/* Function  structure for function  `get_canteen_deduction` */

