/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `get_canteen_deduction`(gross_income DECIMAL(18,3),badgenumbers VARCHAR(100),attendance_ids varchar(100)) RETURNS decimal(18,3)
BEGIN
    
	DECLARE taxableincome DECIMAL(18,3);
	declare canteenDeduction DECIMAL(18,3);
	SET canteenDeduction = (SELECT
					CASE WHEN SUM(card_pos_deduct) IS NULL THEN 0
						ELSE SUM(card_pos_deduct) 
					END
				FROM
				ess_db.payroll_new_attendance
				WHERE
				badgenumber = badgenumbers
				AND
				attendance_name = attendance_ids
				);
		
	SET taxableincome = gross_income - canteenDeduction; --  CALCULATION BA
	RETURN taxableincome;
    END */$$
