/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `get_in_schedule`(gen_date date ,week_days INT ,department_id int,employee_id INT) RETURNS varchar(255) CHARSET latin1
BEGIN
	DECLARE week_name VARCHAR(255);
	
	IF week_days = '0' THEN
	   SET week_name =  (SELECT get_time_in(concat(gen_date,' ',b.`ss_in`),employee_id)
			    FROM ess_db.tbl_time_attendance_per_week a
			    INNER JOIN  ess_db.tbl_time_attendance_shift_schedules b
			    ON a.`wk_0` = b.`ss_id`
			    WHERE a.wk_valid_from <= gen_date AND 
			    a.wk_valid_to >= gen_date AND
			    a.department_id = department_id 
