			    WHERE a.wk_valid_from <= gen_date AND 
			    a.wk_valid_to >= gen_date AND
			    a.department_id = department_id LIMIT 1);
	ELSEIF week_days = '2' THEN
	   SET week_name = (SELECT get_time_in(CONCAT(gen_date,' ',b.`ss_in`),employee_id)
			    FROM ess_db.tbl_time_attendance_per_week a
			    INNER JOIN  tbl_time_attendance_shift_schedules b
			    ON a.`wk_2` = b.`ss_id`
			    WHERE a.wk_valid_from <= gen_date AND 
			    a.wk_valid_to >= gen_date AND
			    a.department_id = department_id LIMIT 1);
	ELSEIF week_days = '3' THEN
	   SET week_name = (SELECT get_time_in(CONCAT(gen_date,' ',b.`ss_in`),employee_id)
			    FROM ess_db.tbl_time_attendance_per_week a
			    INNER JOIN  tbl_time_attendance_shift_schedules b
			    ON a.`wk_3` = b.`ss_id`
			    WHERE a.wk_valid_from <= gen_date AND 
			    a.wk_valid_to >= gen_date AND
			    a.department_id = department_id LIMIT 1);
	ELSEIF week_days = '4' THEN
	   SET week_name = (SELECT get_time_in(CONCAT(gen_date,' ',b.`ss_in`),employee_id)
			    FROM ess_db.tbl_time_attendance_per_week a
			    INNER JOIN  tbl_time_attendance_shift_schedules b
			    ON a.`wk_4` = b.`ss_id`
			    WHERE a.wk_valid_from <= gen_date AND 
			    a.wk_valid_to >= gen_date AND
			    a.department_id = department_id LIMIT 1);
	ELSEIF week_days = '5' THEN
	   SET week_name = (SELECT get_time_in(CONCAT(gen_date,' ',b.`ss_in`),employee_id)
			    FROM ess_db.tbl_time_attendance_per_week a
			    INNER JOIN  tbl_time_attendance_shift_schedules b
			    ON a.`wk_5` = b.`ss_id`
			    WHERE a.wk_valid_from <= gen_date AND 
			    a.wk_valid_to >= gen_date AND
			    a.department_id = department_id LIMIT 1);
	ELSE
	   SET week_name = (SELECT get_time_in(CONCAT(gen_date,' ',b.`ss_in`),employee_id)
			    FROM ess_db.tbl_time_attendance_per_week a
			    INNER JOIN  tbl_time_attendance_shift_schedules b
