/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `get_over_time`(schedule_out DATETIME,time_out DATETIME) RETURNS time
BEGIN
	  DECLARE over_time TIME;
	  IF (schedule_out < time_out) THEN
		SET over_time = (SELECT TIMEDIFF(time_out,schedule_out));
