/* Function  structure for function  `get_ta_add_breaktime` */

/*!50003 DROP FUNCTION IF EXISTS `get_ta_add_breaktime` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `get_ta_add_breaktime`(gen_date DATE,breaktime TIME) RETURNS varchar(20) CHARSET latin1
BEGIN
		DECLARE add_date_out VARCHAR(20);
		IF breaktime BETWEEN '00:00:00' AND '05:00:00' THEN 
			SET add_date_out = DATE_ADD(CONCAT_WS(' ',gen_date,breaktime),INTERVAL 1 DAY);
		ELSE
			SET add_date_out = CONCAT_WS(' ',gen_date,breaktime);
		END IF;
		
		RETURN add_date_out;
    END */$$
DELIMITER ;

