/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `get_ta_add_date_out`(gen_date DATE,schedule_in TIME,schedule_out TIME) RETURNS varchar(20) CHARSET latin1
BEGIN
		DECLARE add_date_out VARCHAR(20);
		IF schedule_in > schedule_out THEN
			SET add_date_out = DATE_ADD(CONCAT_WS(' ',gen_date,schedule_out),INTERVAL 1 DAY);
		ELSE
			SET add_date_out = CONCAT_WS(' ',gen_date,schedule_out);
		END IF;
		
		RETURN add_date_out;
    END */$$
