/* Function  structure for function  `get_ta_bt_schedule_in` */

/*!50003 DROP FUNCTION IF EXISTS `get_ta_bt_schedule_in` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `get_ta_bt_schedule_in`(in_employee_id INT,
					   in_department_id INT,
					   in_group_tag INT,
					   in_gen_date DATE,
					   in_week_days INT
					   ) RETURNS varchar(255) CHARSET latin1
BEGIN
		DECLARE shift_schedule VARCHAR(255);
		DECLARE check_even_odd VARCHAR(20);
		
		SET check_even_odd  = (SELECT get_check_odd_even(WEEK(in_gen_date,1)));
		
		IF(SELECT cts_ss FROM tbl_time_attendance_cts WHERE cts_employee_id = in_employee_id AND cts_date = in_gen_date AND cts_status = '1') > 0 THEN
				 SET shift_schedule = (SELECT 
								(SELECT ss_break_in FROM tbl_time_attendance_shift_schedules WHERE ss_id = b.ss_id ) AS ss_break_in
							FROM 
								tbl_time_attendance_cts a
							INNER JOIN
								tbl_time_attendance_shift_schedules b
							ON
								a.cts_ss = b.ss_id
							WHERE 
								a.cts_employee_id = in_employee_id AND 
								a.cts_date = in_gen_date AND 
								a.cts_status = '1'
								LIMIT 1
							);
			ELSEIF(SELECT wk_id FROM tbl_time_attendance_per_week_employee WHERE wk_valid_from <= in_gen_date AND wk_valid_to >= in_gen_date AND employee_id = in_employee_id AND wk_status = '1') > 0 THEN
				IF in_week_days = '0' THEN 
					SET shift_schedule = (SELECT 
								(
								SELECT 
									ss_break_in FROM tbl_time_attendance_shift_schedules 
								WHERE 
									ss_id = a.wk_0
