/* Function  structure for function  `get_ta_hd_status` */

/*!50003 DROP FUNCTION IF EXISTS `get_ta_hd_status` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `get_ta_hd_status`(gen_date date) RETURNS int(11)
BEGIN
		DECLARE hd_ta_status INT(11);
		DECLARE hd_count INT;
		SET hd_count = (SELECT 
					COUNT(hd_name) 
				FROM 
					tbl_time_attendance_holiday 
