									DATE_FORMAT(date_to,'%m-%d') >= DATE_FORMAT(gen_date,'%m-%d') AND 
									hd_status = '1')
						ELSE
							(SELECT COUNT(hd_name) FROM tbl_time_attendance_holiday 
									WHERE 
									date_from <= gen_date AND 
									date_to >= gen_date AND 
									hd_status = '1')
						END);
	-- 				
		IF(hd_count > 0) THEN 
			SET hd_ta_status = '1';
		ELSE
			SET hd_ta_status = '0';
		END IF;
		
		RETURN hd_ta_status;
    END */$$
