/* Function  structure for function  `get_ta_late_approval` */

/*!50003 DROP FUNCTION IF EXISTS `get_ta_late_approval` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `get_ta_late_approval`(in_employee_id INT,in_gen_date date,in_late Varchar(100),work_hours time,schedule_in TIME,schedule_out TIME) RETURNS varchar(100) CHARSET latin1
BEGIN
	DECLARE late_approval VARCHAR(100);
	DECLARE late_checking VARCHAR(100);
	DECLARE in_gen_date2 VARCHAR(100);
	
	IF schedule_in > schedule_out THEN
		SET in_gen_date2 = DATE_ADD(in_gen_date,INTERVAL 1 DAY);
	ELSE
		SET in_gen_date2 = in_gen_date;
	END IF;
	SET late_checking = (SELECT 
					late_time_in 
			     FROM 
					tbl_ta_late 
			     WHERE 
					late_emp_id = in_employee_id AND 
					late_gen_date = in_gen_date2 AND 
					late_status = '1'
					LIMIT 1);
					
	IF in_late = 'FOR APPROVAL' THEN
		IF late_checking > 0 THEN 
			IF schedule_in > schedule_out THEN
				SET late_approval = TIMEDIFF(
								CONCAT_WS(' ',DATE_ADD(in_gen_date,INTERVAL 1 DAY),late_checking),
								CONCAT_WS(' ',in_gen_date,schedule_in)
							     );
			ELSE
				SET late_approval = TIMEDIFF(late_checking,schedule_in);
			END IF;
		ELSE
			SET late_approval = work_hours;
		END IF;
	ELSE
		SET late_approval = in_late;
	END IF;
	-- return the late_approval
	RETURN late_approval;	
	
    END */$$
DELIMITER ;

/* Function  structure for function  `get_ta_late_per_day` */

/*!50003 DROP FUNCTION IF EXISTS `get_ta_late_per_day` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `get_ta_late_per_day`(in_employee_id INT,
							 schedule_in DATETIME,
							 time_in DATETIME,
							 in_gen_date DATE,
							 department_id INT,
							 in_badgenumber VARCHAR(100),
							 schedule_out TIME) RETURNS varchar(255) CHARSET latin1
BEGIN
		  DECLARE late VARCHAR(255);
		  DECLARE agency INT;
		  
		  SET agency = (SELECT company_id FROM users WHERE employee_id = in_employee_id LIMIT 1);
		  
		  IF agency = '1' THEN
			  IF time_in > schedule_in THEN
				SET late = TIMEDIFF(time_in, schedule_in);
			  ELSE
				SET late = '00:00:00';
			  END IF;
			  
		  ELSE
			--   IF time_in >= ADDTIME(schedule_in,'00:00:00') AND time_in <= ADDTIME(schedule_in,'00:05:59') THEN
			  IF time_in > schedule_in THEN
				SET late = TIMEDIFF(time_in, schedule_in);
			  ELSE
				SET late = '00:00:00';
			  END IF;
			  
		  END IF;
		  RETURN late;
	END */$$
DELIMITER ;

/* Function  structure for function  `get_ta_late_status` */

/*!50003 DROP FUNCTION IF EXISTS `get_ta_late_status` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `get_ta_late_status`(schedule_in TIME ,time_in TIME) RETURNS int(11)
BEGIN
		DECLARE late_status INT;
		DECLARE gen_date_in VARCHAR(50);
		SET gen_date_in = ADDTIME(schedule_in,CONCAT_WS(DATE_FORMAT(schedule_in, '%Y-%m-%d'),'00:00:01'));
		IF(time_in >= gen_date_in) THEN
			SET late_status = '1';
		ELSE
			SET late_status = '0';
		END IF;
		
		RETURN late_status;
    END */$$
DELIMITER ;

/* Function  structure for function  `get_ta_leave_status` */

/*!50003 DROP FUNCTION IF EXISTS `get_ta_leave_status` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `get_ta_leave_status`(in_badgenumber INT,in_gen_date DATE) RETURNS int(11)
BEGIN
		DECLARE leave_ta_status INT(11);
		DECLARE leave_count INT;
		SET leave_count = (SELECT 
					  COUNT(employee_id) 
				   FROM 
					 leave_history 
				   WHERE 
					notification_type IN ('1') AND
					STATUS = 'Approved' AND
					date_from <= in_gen_date AND 
					date_to >= in_gen_date AND
					employee_id = in_badgenumber
					LIMIT 1);
		IF(leave_count > 0) THEN 
			SET leave_ta_status = '1';
		ELSE
			SET leave_ta_status = '0';
		END IF;
		
		RETURN leave_ta_status;
    END */$$
