DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `get_ta_ot_in`(date_in DATETIME ,employee_id INT) RETURNS datetime
BEGIN
	 DECLARE time_in DATETIME;
	 
	 SET time_in = (SELECT MIN(checktime)
			 FROM adms_db.checkinout 
			 WHERE userid = employee_id AND
			 checktype NOT IN('2','3') AND
			 checktime BETWEEN DATE_ADD(date_in, INTERVAL -5 HOUR) AND DATE_ADD(date_in, INTERVAL 5 HOUR));
	RETURN time_in;
    END */$$
