/* Function  structure for function  `get_ta_over_break` */

/*!50003 DROP FUNCTION IF EXISTS `get_ta_over_break` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `get_ta_over_break`(in_employee_id INT,
					   in_department_id INT,
					   in_group_tag INT,
					   in_gen_date DATE,
					   in_week_days INT,
					   in_rd_status INT,
					   in_hd_status INT,
					   in_leave_status INT,
					   in_suspended_status INT,
					   in_attendances_status INT
					   ) RETURNS varchar(255) CHARSET latin1
BEGIN
		DECLARE break_schedule VARCHAR(255);
		DECLARE check_bt_schedule INT;
		DECLARE in_cts_ss INT;
		DECLARE in_cts_group_status INT;
		DECLARE in_cts_group_id INT;
		
		SET in_cts_ss 		= (SELECT cts_ss FROM tbl_time_attendance_cts WHERE cts_employee_id = in_employee_id AND cts_date = in_gen_date AND cts_status = '1' AND cts_group_status = '0');
		SET in_cts_group_status = (SELECT cts_group_status FROM tbl_time_attendance_cts WHERE cts_employee_id = in_employee_id AND cts_date = in_gen_date AND cts_status = '1');
		SET in_cts_group_id 	= (SELECT cts_group_id FROM tbl_time_attendance_cts WHERE cts_employee_id = in_employee_id AND cts_date = in_gen_date AND cts_status = '1');
		
		SET check_bt_schedule  = (SELECT 
						COUNT(`bt_end`)
					  FROM 
						ess_db.`tbl_time_attendance_bt`
					  WHERE 
						`bt_dept`	= in_department_id AND 
						`bt_date` 	= in_gen_date AND 
						`bt_gn`		= in_group_tag AND
						`status` 	= '1');
						
		IF in_rd_status = '1' OR in_hd_status = '1' OR in_leave_status = '1' OR in_suspended_status = '1' OR in_attendances_status = '1' THEN
			SET break_schedule = '00:00:00';
		ELSE
		-- GET BREAK PER DAY BREAK
			IF (in_cts_ss > 0) THEN
			 SET break_schedule = (SELECT (SELECT(
							      SEC_TO_TIME(
									  SUM(
										 TIME_TO_SEC(get_bt_out('00:30:00',
												    get_ta_add_breaktime(in_gen_date,(SELECT ss_break_in FROM tbl_time_attendance_shift_schedules WHERE ss_id = a.cts_ss)),
												    get_ta_add_breaktime(in_gen_date,(SELECT ss_break_out FROM tbl_time_attendance_shift_schedules WHERE ss_id = a.cts_ss)),
												    in_employee_id,
												    in_department_id)
											    )
									     )
									 )
							     )
						      )
						FROM 
							tbl_time_attendance_cts a
						INNER JOIN
							tbl_time_attendance_shift_schedules b
						ON
							a.cts_ss = b.ss_id
						WHERE 
							a.cts_employee_id = in_employee_id AND 
							a.cts_date = in_gen_date AND 
							a.cts_status = '1'
							LIMIT 1
