/* Function  structure for function  `get_ta_schedule` */

/*!50003 DROP FUNCTION IF EXISTS `get_ta_schedule` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `get_ta_schedule`(in_employee_id INT,
					   in_department_id INT,
					   in_group_tag INT,
					   in_gen_date DATE,
					   in_week_days INT
					   ) RETURNS varchar(255) CHARSET latin1
BEGIN
		DECLARE shift_schedule varchar(255);
		-- GET SCHEDULE IN
		IF(SELECT cts_ss FROM tbl_time_attendance_cts WHERE cts_employee_id = in_employee_id AND cts_date = in_gen_date) > 0 THEN
			 SET shift_schedule = (SELECT 
							a.cts_ss,
							b.ss_name,
							b.ss_in,
							b.ss_out,
							b.ss_break_in,
							b.ss_break_out,
							b.ss_work_hours
						FROM 
							tbl_time_attendance_cts a
						INNER JOIN
							tbl_time_attendance_shift_schedules b
						ON
							a.cts_ss = b.ss_id
						WHERE 
							a.cts_employee_id = in_employee_id AND 
							a.cts_date = in_gen_date AND 
							b.ss_status = '1'
							LIMIT 1
						);
			ELSE 
				SET shift_schedule = "No Record";
		END IF;
		RETURN shift_schedule;
    END */$$
DELIMITER ;

