/* Function  structure for function  `get_ta_time_in` */

/*!50003 DROP FUNCTION IF EXISTS `get_ta_time_in` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `get_ta_time_in`(date_in datetime ,employee_id INT) RETURNS datetime
BEGIN
	 DECLARE time_in DATETIME;
	 DECLARE in_department_id INT;
	 SET in_department_id = (SELECT department_id FROM users WHERE employee_id = employee_id LIMIT 1);
	 
	 IF in_department_id = '7' THEN
		 SET time_in = (SELECT MIN(checktime)
			 FROM adms_db.checkinout 
			 WHERE userid = employee_id AND
			 checktype NOT IN('2','3') AND
			 checktime BETWEEN DATE_ADD(date_in, INTERVAL -2 HOUR) AND DATE_ADD(date_in, INTERVAL 5 HOUR) AND
			 SN IN ('3569184260109','333'));
	 ELSE
		 SET time_in = (SELECT MIN(checktime)
				 FROM adms_db.checkinout 
				 WHERE userid = employee_id AND
				 checktype NOT IN('2','3') AND
				 checktime BETWEEN DATE_ADD(date_in, INTERVAL -2 HOUR) AND DATE_ADD(date_in, INTERVAL 5 HOUR));
	 END IF;
	RETURN time_in;
    END */$$
DELIMITER ;

