DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `get_ta_time_out`(date_in DATETIME, date_out DATETIME ,employee_id INT) RETURNS datetime
BEGIN 
	 DECLARE time_in DATETIME;
	 DECLARE in_department_id INT;
	 
	 SET in_department_id = (SELECT department_id FROM users WHERE employee_id = employee_id LIMIT 1);
	 
	 IF in_department_id = '7' THEN 
	 IF(date_out > date_in) THEN
		 SET time_in = (SELECT MAX(checktime)
				 FROM adms_db.checkinout 
				 WHERE userid = employee_id AND
				 checktype NOT IN('2','3') AND
				 checktime BETWEEN DATE_ADD(date_out, INTERVAL -5 HOUR) AND DATE_ADD(date_out, INTERVAL 9 HOUR) AND
				 SN IN ('3569184260109','333'));
	  ELSE
		  SET date_out = (SELECT DATE_ADD(date_out, INTERVAL 1 DAY));
		  SET time_in = (SELECT MAX(checktime)
				 FROM adms_db.checkinout 
				 WHERE userid = employee_id AND
				 checktype NOT IN('2','3') AND
				 checktime BETWEEN DATE_ADD(date_out, INTERVAL -5 HOUR) AND DATE_ADD(date_out, INTERVAL 9 HOUR) AND
				 SN IN ('3569184260109','333'));
	  END IF;
	  ELSE
		  IF(date_out > date_in) THEN
			  SET time_in = (SELECT MAX(checktime)
					 FROM adms_db.checkinout 
					 WHERE userid = employee_id AND
					 checktype NOT IN('2','3') AND
				      checktime BETWEEN DATE_ADD(date_out, INTERVAL -5 HOUR) AND DATE_ADD(date_out, INTERVAL 9 HOUR));
		  ELSE
			  SEt date_out = (SELECT DATE_ADD(date_out, INTERVAL 1 DAY));
			  SET time_in  = (SELECT MAX(checktime)
					  FROM adms_db.checkinout 
					  WHERE userid = employee_id AND
