/* Function  structure for function  `get_ta_under_time` */

/*!50003 DROP FUNCTION IF EXISTS `get_ta_under_time` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `get_ta_under_time`(schedule_out TIME,time_out TIME) RETURNS time
BEGIN
	  DECLARE under_time TIME;
	  DECLARE under_time2 TIME;
	  DECLARE sign_under_time TIME;
	  IF (time_out < schedule_out) THEN
		SET under_time2 = (SELECT TIMEDIFF(schedule_out,time_out));
		SET sign_under_time = SIGN(under_time2);
		
		  IF(sign_under_time = '-1') THEN
			SET under_time = "00:00:00";
		  ELSE 
			SET under_time = (SELECT TIMEDIFF(time_out, schedule_out) * 1);
			 
		  END IF;       
	  ELSE
		SET under_time2 = "00:00:00";
	  END IF;
	  RETURN under_time2;
    END */$$
DELIMITER ;

