/* Function  structure for function  `new_payroll_get_holiday_regular` */

/*!50003 DROP FUNCTION IF EXISTS `new_payroll_get_holiday_regular` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `new_payroll_get_holiday_regular`(in_attendancename VARCHAR(100),
					in_badgenumber VARCHAR(200),
					in_attendance_date DATE
		
				) RETURNS decimal(18,2)
BEGIN
	
	DECLARE holidaypay DECIMAL(18,2);
	DECLARE totalregularholiday INT;
	DECLARE perday DECIMAL(18,2);
	SET totalregularholiday = (SELECT COUNT(id) FROM payroll_generated_holiday WHERE
			attendance_name = in_attendancename AND holiday_date = in_attendance_date
			AND holiday_type = 'Regular Holiday'
			);
			
	
	SET perday = (SELECT `new_payroll_get_perday`( 
	
	
	(SELECT salary FROM  payroll_new_attendance WHERE badgenumber =  in_badgenumber
								AND attendance_name = in_attendancename AND gen_date = in_attendance_date )
								
								
	, (SELECT w_satworkdingday FROM  payroll_new_attendance WHERE badgenumber =  in_badgenumber
								AND attendance_name = in_attendancename AND gen_date = in_attendance_date )
	, (SELECT payperiod FROM  payroll_new_attendance WHERE badgenumber =  in_badgenumber
								AND attendance_name = in_attendancename AND gen_date = in_attendance_date ) ) );
	SET holidaypay = perday * totalregularholiday;
	
	RETURN holidaypay;
    END */$$
DELIMITER ;

