/* Function  structure for function  `new_payroll_get_late_overtime_overbreak` */

/*!50003 DROP FUNCTION IF EXISTS `new_payroll_get_late_overtime_overbreak` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `new_payroll_get_late_overtime_overbreak`(inhourlyrate DECIMAL(18,4), inlate TIME, inundertime TIME, inoverbreak TIME) RETURNS decimal(18,2)
BEGIN
	DECLARE totalDeduct DECIMAL(18,4);
		DECLARE totalLate DECIMAL(18,4);
		DECLARE totalUndertime DECIMAL(18,4);
		DECLARE totalOverbreak DECIMAL(18,4);
			
		DECLARE totalLatehrs  DECIMAL(18,4);
		DECLARE totalLatemns  DECIMAL(18,4);
		DECLARE totalUndertimehrs  DECIMAL(18,4);
		DECLARE totalUndertimemns  DECIMAL(18,4);
		DECLARE totalOverbreakhrs  DECIMAL(18,4);
		DECLARE totalOverbreakmns  DECIMAL(18,4);
		
		
		-- LATE HOURS
		SET totalLatehrs = inhourlyrate * HOUR(inlate);
		-- LATE MINUTES
		SET totalLatemns = inhourlyrate / 60 * MINUTE(inlate);
		
		-- UNDERTIME HOURS
		SET totalUndertimehrs = inhourlyrate * HOUR(inundertime);
		-- UNDERTIME MINUTES
		SET totalUndertimemns = inhourlyrate / 60 * MINUTE(inundertime);
		
		-- OVERBREAK HOURS
		SET totalOverbreakhrs = inhourlyrate * HOUR(inoverbreak);
		-- OVERBREAK MINUTES
		SET totalOverbreakmns = inhourlyrate / 60 * MINUTE(inoverbreak);
		
	-- 	SET totalLate = totalLatehrs + totalLatemns;
		SET totalLate = func_new_late(inhourlyrate , inlate);
		SET totalUndertime = func_new_late(inhourlyrate , inundertime);
		SET totalOverbreak = totalOverbreakhrs + totalOverbreakmns;
		
		SET totalDeduct = totalLate + totalUndertime + totalOverbreak;
		
		RETURN totalDeduct;
		
    END */$$
DELIMITER ;

/* Function  structure for function  `new_payroll_get_ot_pay` */

/*!50003 DROP FUNCTION IF EXISTS `new_payroll_get_ot_pay` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `new_payroll_get_ot_pay`(in_total_ot TIME, in_employe_id INT 
    
    ) RETURNS decimal(18,2)
BEGIN
    
	DECLARE basicsalary DECIMAL(18,3);
	DECLARE perminute DECIMAL(18,2);
	DECLARE spayperiod INT;
	DECLARE spayperhour DECIMAL(18,2);
	DECLARE spayminute DECIMAL(18,2);
	
	DECLARE totalothours INT;
	DECLARE totalotminutes INT;
	
	
	DECLARE otpay DECIMAL(18,3);
	
	
	SET basicsalary = (SELECT salary FROM users WHERE employee_id = in_employe_id);
	SET spayperiod = (SELECT payperiod FROM users WHERE employee_id = in_employe_id);
	
	IF spayperiod = 2  THEN 
 		SET perminute = (   SELECT (`new_payroll_get_perday`(salary, w_satworkdingday , payperiod ) / 8 ) / 60 FROM users WHERE employee_id = in_employe_id ) ;
	ELSE
		SET perminute = (SELECT new_payroll_get_hourlyrate(basicsalary)   / 60 );
	
	END IF;
	
	
	
	
	IF HOUR(in_total_ot) = 0 THEN
		SET spayperhour = perminute;
		
	ELSE
		SET spayperhour =  (HOUR(in_total_ot) * 60 ) *  perminute;
	END IF;
	
	IF MINUTE(in_total_ot) = 0 THEN
		SET spayminute = 0;
		
	ELSE
		SET spayminute = perminute * MINUTE(in_total_ot);
	END IF;
	
	
	
	SET otpay = spayperhour + spayminute;
	RETURN otpay;
    END */$$
DELIMITER ;

/* Function  structure for function  `new_payroll_get_perday` */

/*!50003 DROP FUNCTION IF EXISTS `new_payroll_get_perday` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `new_payroll_get_perday`(inbasicsalary DECIMAL(18,2), inwithsat INT , inpayperiod INT 
    
    ) RETURNS decimal(18,2)
BEGIN
	DECLARE dailyrate DECIMAL(18,2);
	DECLARE totaldayworkdaysyear INT;
	
	IF inpayperiod = 3 THEN
		SET dailyrate = inbasicsalary;
	
	ELSE
		IF inwithsat = 0 OR inwithsat = '' THEN
			SET totaldayworkdaysyear = 261 ;
		ELSE
			SET totaldayworkdaysyear = 313 ;
		END IF;
		
		
		SET dailyrate = (inbasicsalary * 12) / totaldayworkdaysyear;
	
	END IF;
	
	RETURN ROUND(dailyrate,2);
    END */$$
DELIMITER ;

