/* Function  structure for function  `payroll_checkdaysworkstatus` */

/*!50003 DROP FUNCTION IF EXISTS `payroll_checkdaysworkstatus` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `payroll_checkdaysworkstatus`(inrd_status INT,
						inhd_status INT,
						inleave_status INT,
						insuspended_status INT,
						inlate_status INT,
						inabsent_status INT,
						inundertime TIME
						) RETURNS varchar(50) CHARSET utf8mb4
BEGIN
	
		  
	DECLARE workstats VARCHAR(50);
	
	IF inrd_status = 0 AND inhd_status = 0 AND inleave_status = 0 AND insuspended_status = 0 AND inlate_status = 0 AND inabsent_status = 1 AND inundertime = '00:00:00'  THEN 
		SET workstats = 'Absence';
	ELSEIF inrd_status = 0 AND inhd_status = 0 AND inleave_status = 0 AND insuspended_status = 0 AND inlate_status = 0 AND inabsent_status = 0 AND inundertime = '00:00:00' THEN 
		SET workstats = 'Pumasok';
	ELSEIF inrd_status = 0 AND inhd_status = 0 AND inleave_status = 0 AND insuspended_status = 0 AND inlate_status = 1 AND inabsent_status = 0 AND inundertime = '00:00:00' THEN 
		SET workstats = 'Late';
	ELSEIF inrd_status = 0 AND inhd_status = 0 AND inleave_status = 0 AND insuspended_status = 0 AND inlate_status = 0 AND inabsent_status = 0 AND inundertime != '00:00:00'  THEN 
		SET workstats = 'Undertime';	
	ELSEIF inrd_status = 0 AND inhd_status = 0 AND inleave_status = 0 AND insuspended_status = 0 AND inlate_status = 1 AND inabsent_status = 0 AND inundertime != '00:00:00'  THEN 
		SET workstats = 'LateUndertime';	
	ELSEIF inrd_status = 0 AND inhd_status = 0 AND inleave_status = 1 AND insuspended_status = 0 AND inlate_status = 0 AND inabsent_status = 0 AND inundertime = '00:00:00'  THEN 
		SET workstats = 'Leave';	
		
		
	ELSE
		SET workstats = '';
	END IF;
	
	RETURN workstats;
    
	
	
    END */$$
DELIMITER ;

