/* Function  structure for function  `payroll_detaild_gross` */

/*!50003 DROP FUNCTION IF EXISTS `payroll_detaild_gross` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `payroll_detaild_gross`(badgenumbers VARCHAR(100),attendance_names VARCHAR(100)) RETURNS decimal(18,3)
BEGIN
DECLARE totalgrossincome DECIMAL(18,3);
      
    	SET totalgrossincome = (SELECT
	(SUM(CASE
	-- PUMASOK NG WALANG LATE
	WHEN a.rd_status = 0 AND a.hd_status = 0 AND a.leave_status = 0 AND a.suspended_status = 0 AND  a.late_status = 0 AND  a.time_in IS NOT NULL AND a.time_out IS NOT NULL 
		THEN 
			(SELECT
				CASE 
					WHEN COUNT(id) = 0 THEN payroll_get_hourlyrate(a.salary)*8-payroll_get_hourlyrate(a.salary)*8 + payroll_get_overtime(a.badgenumber,a.gen_date,a.salary) + payroll_get_nightdiff (a.gen_date,a.schedule_in,a.time_in,a.schedule_out,a.time_out,a.badgenumber, payroll_get_hourlyrate(a.salary))
					ELSE salary 
				END
			FROM
				ess_db.payroll_setup_wfixsalary
			WHERE
				badgenumber = a.badgenumber
			AND
				date_for_fixdate = a.gen_date
			)
	-- NO LATE UNDERTIME
	
	
	
	-- LATE UNDERTIME OVERBREAK
	WHEN a.rd_status = 0 AND a.hd_status = 0 AND a.leave_status = 0 AND a.suspended_status = 0 AND  a.late_status = 1  AND a.time_in IS NOT NULL AND a.time_out IS NOT NULL
		THEN
			(SELECT
				CASE 
					WHEN COUNT(id) = 0 THEN  -ROUND(payroll_get_late_cal(payroll_get_hourlyrate(a.salary),TIME_FORMAT(a.late,'%i'),TIME_FORMAT(a.undertime,'%i'),TIME_FORMAT(a.over_break,'%i')),2)+ payroll_get_overtime(a.badgenumber,a.gen_date,a.salary) + payroll_get_nightdiff (a.gen_date,a.schedule_in,a.time_in,a.schedule_out,a.time_out,a.badgenumber, payroll_get_hourlyrate(a.salary))
	
					ELSE -ROUND(payroll_get_late_cal(payroll_get_hourlyperday(salary),TIME_FORMAT(a.late,'%i'),TIME_FORMAT(a.undertime,'%i'),TIME_FORMAT(a.over_break,'%i')),2)+ payroll_get_overtime(a.badgenumber,a.gen_date,a.salary) + payroll_get_nightdiff (a.gen_date,a.schedule_in,a.time_in,a.schedule_out,a.time_out,a.badgenumber, payroll_get_hourlyperday(salary))
				END
			FROM
				ess_db.payroll_setup_wfixsalary
			WHERE
				badgenumber = a.badgenumber
			AND
				date_for_fixdate = a.gen_date
			)
		
	-- HINDI PUMASOK
	WHEN a.rd_status = 0 AND a.hd_status = 0 AND a.leave_status = 0 AND a.suspended_status = 0 AND  a.late_status = 0 AND a.time_in IS NULL AND a.time_out IS NULL
		THEN 
	-- 		(SELECT
		(-(payroll_get_hourlyrate(a.salary)*8))
	
	
							
	-- PUMASOK NG HOLIDAY NA HINDI LATE
	WHEN a.rd_status = 0 AND a.hd_status = 1 AND a.leave_status = 0 AND a.suspended_status = 0 AND  a.late_status = 0 AND  a.time_in IS NOT NULL AND a.time_out IS NOT NULL 
				THEN (SELECT
						CASE
							
							WHEN s.id = '1' THEN  payroll_get_hourlyrate(a.salary)*8*2
							WHEN s.id = '2' THEN  payroll_get_hourlyrate(a.salary)*8+(payroll_get_hourlyrate(a.salary)*8*0.3)
						END
					FROM 
						ess_db.tbl_time_attendance_holiday r
					LEFT JOIN
						ess_db.tbl_holiday_type s ON
						s.id = r.hd_type
					WHERE 
						date_from = a.gen_date AND date_to >=  a.gen_date
					)
	-- PUMASOK NG HOLIDAY NA HINDI LATE AT RESTDAY
	WHEN a.rd_status = 1 AND a.hd_status = 1 AND a.leave_status = 0 AND a.suspended_status = 0 AND  a.late_status = 0 AND  a.time_in IS NOT NULL AND a.time_out IS NOT NULL 
				THEN (SELECT
						CASE
							
							WHEN s.id = '1' THEN  payroll_get_hourlyrate(a.salary)*8*2+(payroll_get_hourlyrate(a.salary)*8*2*0.3)
							WHEN s.id = '2' THEN  payroll_get_hourlyrate(a.salary)*8*0.3
						END
					FROM 
						ess_db.tbl_time_attendance_holiday r
					LEFT JOIN
						ess_db.tbl_holiday_type s ON
						s.id = r.hd_type
					WHERE 
						date_from = a.gen_date AND date_to >=  a.gen_date
					)
											
	-- HINDI PUMASOK NG HOLIDAY AT RESTDAY
	WHEN a.rd_status = 1 AND a.hd_status = 1 AND a.leave_status = 0 AND a.suspended_status = 0 AND  a.late_status = 0 AND  a.time_in IS NULL AND a.time_out IS NULL 
				THEN (SELECT
						CASE
							
							WHEN s.id = '1' THEN  payroll_get_hourlyrate(a.salary)*8
						END
					FROM 
						ess_db.tbl_time_attendance_holiday r
					LEFT JOIN
						ess_db.tbl_holiday_type s ON
						s.id = r.hd_type
					WHERE 
						date_from = a.gen_date AND date_to >=  a.gen_date
					)
					
					
					
	-- PUMASOK NG HOLIDAY NA MAY LATE
	WHEN a.rd_status = 0 AND a.hd_status = 1 AND a.leave_status = 0 AND a.suspended_status = 0 AND  a.late_status = 1  AND a.time_in IS NOT NULL AND a.time_out IS NOT NULL 
		THEN CONCAT_WS('','(',payroll_get_late_cal(payroll_get_hourlyrate(a.salary)*2,TIME_FORMAT(a.late,'%i'),TIME_FORMAT(a.undertime,'%i'),TIME_FORMAT(a.over_break,'%i')),')')
	-- HINDI PUMASOK NG HOLIDAY
	WHEN a.rd_status = 0 AND a.hd_status = 1 AND a.leave_status = 0 AND a.suspended_status = 0 AND  a.late_status = 0 AND  a.time_in IS NULL AND a.time_out IS NULL 
		THEN (SELECT
				CASE
					
					WHEN s.id = '1' THEN  payroll_get_hourlyrate(a.salary)*8- payroll_get_hourlyrate(a.salary)*8
					WHEN s.id = '2' THEN  payroll_get_hourlyrate(a.salary)*8- payroll_get_hourlyrate(a.salary)*8
				END
			FROM 
				ess_db.tbl_time_attendance_holiday r
			LEFT JOIN
				ess_db.tbl_holiday_type s ON
				s.id = r.hd_type
			WHERE 
				date_from = a.gen_date AND date_to >=  a.gen_date
			)
	WHEN a.rd_status = 0 AND a.hd_status = 0 AND a.leave_status = 1 AND a.suspended_status = 0 AND  a.late_status = 0 AND  a.time_in IS NULL AND a.time_out IS NULL 
		THEN (-(payroll_get_hourlyrate(a.salary)*8) + payroll_get_hourlyrate(a.salary)*8)			
			
	WHEN a.rd_status = 1 AND a.hd_status = 0 AND a.leave_status = 0 AND a.suspended_status = 0 AND  a.late_status = 0 AND  a.time_in IS NULL AND a.time_out IS NULL 
		THEN 'PAHINGA NYA'
	WHEN a.rd_status = 1 AND a.hd_status = 1 AND a.leave_status = 0 AND a.suspended_status = 0 AND  a.late_status = 0 AND  a.time_in IS NULL AND a.time_out IS NULL 
		THEN 'RESTDAY NYA'	
				
	ELSE
		'hindi pumasok'
		END)+ a.salary/ payroll_getnoofpayperiod(badgenumbers)  - payroll_canteenDeduct(a.`badgenumber`,b.`attendance_name`) )
	
	FROM
	ess_db.`payroll_new_attendance` a
	LEFT JOIN
	ess_db.`payroll_generated_attendance` b ON
	b.`attendance_name` = a.`attendance_name`
	WHERE
	a.badgenumber = badgenumbers
	AND
	b.attendance_name = attendance_names
	AND
	a.rd_status= '0');
   
   
	RETURN totalgrossincome;
    END */$$
DELIMITER ;

