/* Function  structure for function  `payroll_get_hourlyrate` */

/*!50003 DROP FUNCTION IF EXISTS `payroll_get_hourlyrate` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `payroll_get_hourlyrate`(basicsalary decimal(18,2)) RETURNS decimal(18,2)
BEGIN
	   DECLARE hourly DECIMAL(18,2);
	   DECLARE noofmonths int;
	   DECLARE noofworkdaysinyear int; 
	   DECLARE totalhrsworked INT; 
	   
	   SET noofmonths = 12;
	   SET noofworkdaysinyear = 261;
	   SET totalhrsworked = 8;
	   set hourly = (basicsalary * noofmonths) / noofworkdaysinyear / totalhrsworked ;
	   RETURN hourly;
	--    Computation BASIC salary * no of month / no of workdaysin year (313 pag may sunday) / totalhrs worked
	--    Computation BASIC salary * no of month / no of workdaysin year (261 if no sunday) / totalhrs worked
	
    END */$$
DELIMITER ;

/* Function  structure for function  `payroll_get_late_cal` */

/*!50003 DROP FUNCTION IF EXISTS `payroll_get_late_cal` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `payroll_get_late_cal`(basicsalary DECIMAL(18,3), noofminslate INT, noofminsundertime int, overbreak int) RETURNS decimal(18,3)
BEGIN
	   DECLARE late DECIMAL(18,3);
	   
	   DECLARE minutes INT; 
	   
	   declare late_undertime_overbreak int;
	   
	   DECLARE lateifhour int;
	    DECLARE undertimeifhour INT;
	   
		-- late
		IF TIME_FORMAT(noofminslate,'%H') = '00' THEN
				SET lateifhour = 0 + TIME_FORMAT(noofminslate,'%i');
		elseif TIME_FORMAT(noofminslate,'%H') = '01' then
				set lateifhour = 60 + TIME_FORMAT(noofminslate,'%i');
		elseif TIME_FORMAT(noofminslate,'%H') = '02' THEN
				SET lateifhour = 120 + TIME_FORMAT(noofminslate,'%i');
		ELSEIF TIME_FORMAT(noofminslate,'%H') = '03' THEN
				SET lateifhour = 180 + TIME_FORMAT(noofminslate,'%i');
		ELSEIF TIME_FORMAT(noofminslate,'%H') = '04' THEN
				SET lateifhour = 240 + TIME_FORMAT(noofminslate,'%i');
		ELSEIF TIME_FORMAT(noofminslate,'%H') = '05' THEN
				SET lateifhour = 300 + TIME_FORMAT(noofminslate,'%i');
		ELSEIF TIME_FORMAT(noofminslate,'%H') = '06' THEN
				SET lateifhour = 360 + TIME_FORMAT(noofminslate,'%i');	
		ELSEIF TIME_FORMAT(noofminslate,'%H') = '07' THEN
				SET lateifhour = 420 + TIME_FORMAT(noofminslate,'%i');	
		ELSEIF TIME_FORMAT(noofminslate,'%H') = '07' THEN
				SET lateifhour = 480 + TIME_FORMAT(noofminslate,'%i');	
		end if;
		
		-- undertime
		IF TIME_FORMAT(noofminsundertime,'%H') = '00' THEN
				SET undertimeifhour = 0 + TIME_FORMAT(noofminsundertime,'%i');
		ELSEIF TIME_FORMAT(noofminsundertime,'%H') = '01' THEN
				SET undertimeifhour = 60 + TIME_FORMAT(noofminsundertime,'%i');
		ELSEIF TIME_FORMAT(noofminsundertime,'%H') = '02' THEN
				SET undertimeifhour = 120 + TIME_FORMAT(noofminsundertime,'%i');
		ELSEIF TIME_FORMAT(noofminsundertime,'%H') = '03' THEN
				SET undertimeifhour = 180 + TIME_FORMAT(noofminsundertime,'%i');
		ELSEIF TIME_FORMAT(noofminsundertime,'%H') = '04' THEN
				SET undertimeifhour = 240 + TIME_FORMAT(noofminsundertime,'%i');
		ELSEIF TIME_FORMAT(noofminsundertime,'%H') = '05' THEN
				SET undertimeifhour = 300 + TIME_FORMAT(noofminsundertime,'%i');
		ELSEIF TIME_FORMAT(noofminsundertime,'%H') = '06' THEN
				SET undertimeifhour = 360 + TIME_FORMAT(noofminsundertime,'%i');
		ELSEIF TIME_FORMAT(noofminsundertime,'%H') = '07' THEN
				SET undertimeifhour = 420 + TIME_FORMAT(noofminsundertime,'%i');
		ELSEIF TIME_FORMAT(noofminsundertime,'%H') = '08' THEN
				SET undertimeifhour = 480 + TIME_FORMAT(noofminsundertime,'%i');
		END IF;
		
		
	   
	   set late_undertime_overbreak = lateifhour + undertimeifhour + overbreak;
	   
	   SET minutes = 60;
	   SET late = basicsalary / minutes * late_undertime_overbreak; --  CALCULATION BA
	   
	   
	   RETURN format(round(late,2),3);
	   
    END */$$
DELIMITER ;

/* Function  structure for function  `payroll_get_nightdiff` */

/*!50003 DROP FUNCTION IF EXISTS `payroll_get_nightdiff` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `payroll_get_nightdiff`(gen_dates date, date_schedulein datetime, timein time , date_scheduleout datetime, timeout time, badgenumbers varchar(100), perhourRate decimal(18,3)) RETURNS decimal(18,3)
BEGIN
	declare total_nightdiff decimal (18,3);
	DECLARE new_in int;
	declare subtractbeforin int;
	DECLARE subtractbeforout INT;
	
	set subtractbeforout = ( SELECT  FLOOR(TIME_TO_SEC(TIMEDIFF(timeout,'06:00:00'))/ 3600) ) ;
		if subtractbeforout < 0 then
			set subtractbeforout = 0;
		else
			set subtractbeforout = subtractbeforout;
		end if;
		
	set subtractbeforin =( SELECT  FLOOR(TIME_TO_SEC(TIMEDIFF('22:00:00',timein))/ 3600) );
		if subtractbeforin < 0 then
			set subtractbeforin = 0;
		else
			set subtractbeforin = subtractbeforin;
		end if;
	
		
		IF date_schedulein = date_scheduleout THEN 
			SET new_in = (SELECT FLOOR(TIME_TO_SEC(TIMEDIFF(CONCAT_WS(' ',DATE_FORMAT(date_scheduleout,'%Y-%m-%d'),timeout),CONCAT_WS(' ',DATE_FORMAT(date_scheduleout,'%Y-%m-%d'),'22:00:00')))/ 3600));	
		else
			set new_in = (SELECT FLOOR(TIME_TO_SEC(TIMEDIFF(CONCAT_WS(' ',DATE_FORMAT(date_scheduleout,'%Y-%m-%d'),timeout),CONCAT_WS(' ',DATE_FORMAT(date_schedulein,'%Y-%m-%d'),timein)))/ 3600) - subtractbeforin - subtractbeforout);
		end if;
	
	set total_nightdiff = perhourRate * 0.10 * new_in;
	
		if total_nightdiff < 0 then
			set total_nightdiff = 0;
		else 
			set total_nightdiff = total_nightdiff;
		end if;
	return total_nightdiff;
    END */$$
DELIMITER ;

