/* Function  structure for function  `payroll_get_wholdingtax2` */

/*!50003 DROP FUNCTION IF EXISTS `payroll_get_wholdingtax2` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `payroll_get_wholdingtax2`(basic_pay DECIMAL(18,3), payperiod INT) RETURNS decimal(18,3)
BEGIN
	DECLARE wholdingtax DECIMAL(18,3);
	DECLARE minval DECIMAL(18,3);
	DECLARE taxableincome DECIMAL(18,3);
	DECLARE taxableincomeannualy DECIMAL(18,3);
	
	SET taxableincome = (basic_pay) - (payroll_sss_contribution(basic_pay)+((basic_pay*0.0275)/2)+100.00);
	
	SET taxableincomeannualy = taxableincome  * 12;
	
	-- 	if taxableincomeannualy <= 250000.00 then set minval = 0;
		
		
		IF taxableincomeannualy <= 250000.00 THEN SET minval = 0;
		ELSEIF taxableincomeannualy >= 250000.01 AND taxableincomeannualy <= 400000 THEN SET minval = 0.20;
		ELSEIF taxableincomeannualy >= 400000.01 AND taxableincomeannualy <= 800000 THEN SET minval = 30000 + 0.25;
		ELSEIF taxableincomeannualy >= 800000.01 AND taxableincomeannualy <= 2000000 THEN SET minval = 130000  + 0.30;
		ELSEIF taxableincomeannualy >= 2000000.01 AND taxableincomeannualy <= 8000000 THEN SET minval = 490000   + 0.32;
		ELSE SET minval = 2410000 + 0.35;
		END IF;
 	SET wholdingtax  = (((taxableincome *12) - payroll_table_bir(taxableincome)) * minval) / 12;
	-- 	if wholdingtax 	<= 0 then set wholdingtax = 0;
		
	RETURN wholdingtax;
    
    END */$$
DELIMITER ;

