/* Function  structure for function  `payroll_grossincome` */

/*!50003 DROP FUNCTION IF EXISTS `payroll_grossincome` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `payroll_grossincome`(badgenumbers VARCHAR(100),attendance_names VARCHAR(100)) RETURNS decimal(18,2)
BEGIN
DECLARE totalgrossincome DECIMAL(18,2);
	DECLARE totalbasicpay DECIMAL(18,2);
	DECLARE adjustmentsEarning DECIMAL(18,2);
	DECLARE adjustmentsDeduct DECIMAL(18,2);
	DECLARE payperiodsetup INT;
	
	SET payperiodsetup = (SELECT payperiod FROM payroll_new_attendance WHERE badgenumber = badgenumbers AND attendance_name = attendance_names LIMIT 1 );
	
	IF payperiodsetup = 3 THEN
		SET totalbasicpay = (SELECT salary * (SELECT COUNT(id) FROM payroll_new_attendance WHERE badgenumber = badgenumbers AND attendance_name = attendance_names  AND rd_status = 0 ) FROM payroll_new_attendance WHERE badgenumber = badgenumbers AND attendance_name = attendance_names  LIMIT 1 );
	ELSE 
		SET totalbasicpay = (SELECT ROUND(salary/payperiod,2) FROM payroll_new_attendance WHERE badgenumber = badgenumbers AND attendance_name = attendance_names LIMIT 1 );
	END IF;
	
	SET adjustmentsEarning = (SELECT IFNULL(SUM(amount),0.00) FROM payroll_add_ajustment WHERE badgenumber = badgenumbers AND attendance_name = attendance_names AND TYPE = '1');
	SET adjustmentsDeduct = (SELECT IFNULL(SUM(amount),0.00) FROM payroll_add_ajustment WHERE badgenumber = badgenumbers AND attendance_name = attendance_names AND TYPE = '2');
	SET totalgrossincome = 
	(
		SELECT SUM(
				-- pumasok
				CASE 
					WHEN payroll_checkdaysworkstatus(a.rd_status, a.hd_status, a.leave_status, a.suspended_status, a.late_status, a.absent_status, a.undertime) = 'Absence' THEN
						new_payroll_get_perday(a.salary, a.w_satworkdingday, payperiodsetup)
					WHEN payroll_checkdaysworkstatus(a.rd_status, a.hd_status, a.leave_status, a.suspended_status, a.late_status, a.absent_status, a.undertime ) = 'Late' THEN
						new_payroll_get_late_overtime_overbreak(new_payroll_get_hourlyrate(new_payroll_get_perday(a.salary, a.w_satworkdingday, payperiodsetup)), a.late, a.undertime, a.over_break)
					WHEN payroll_checkdaysworkstatus(a.rd_status, a.hd_status, a.leave_status, a.suspended_status, a.late_status, a.absent_status, a.undertime ) = 'Undertime' THEN
						new_payroll_get_late_overtime_overbreak(new_payroll_get_hourlyrate(new_payroll_get_perday(a.salary, a.w_satworkdingday, payperiodsetup)), a.late, a.undertime, a.over_break)
					WHEN payroll_checkdaysworkstatus(a.rd_status, a.hd_status, a.leave_status, a.suspended_status, a.late_status, a.absent_status, a.undertime ) = 'LateUndertime' THEN
						new_payroll_get_late_overtime_overbreak(new_payroll_get_hourlyrate(new_payroll_get_perday(a.salary, a.w_satworkdingday, payperiodsetup)), a.late, a.undertime, a.over_break)
					WHEN payroll_checkdaysworkstatus(a.rd_status, a.hd_status, a.leave_status, a.suspended_status, a.late_status, a.absent_status, a.undertime ) = 'Leave' THEN
						new_payroll_get_perday(a.salary, a.w_satworkdingday, payperiodsetup)
					
					
				END
			)
		FROM
			`payroll_new_attendance` a
		LEFT JOIN
			`payroll_generated_attendance` b ON
			b.`attendance_name` = a.`attendance_name`
		WHERE
			a.badgenumber = badgenumbers
		AND
			b.attendance_name = attendance_names
	);
   
	
	RETURN totalbasicpay - totalgrossincome + payroll_total_holidays(badgenumbers,attendance_names) + payroll_total_ot(badgenumbers , attendance_names )  + `payroll_total_leave`(badgenumbers,attendance_names) + adjustmentsEarning - adjustmentsDeduct;
	
    END */$$
DELIMITER ;

