BEGIN
    
	
	DECLARE holidayot DECIMAL(18,3);
	IF in_holidaytype = 2 THEN
	
	
	
	SET holidayot = (SELECT
				CASE 
					WHEN COUNT(id) > 0  THEN 
						(SELECT 
							SUM(`payroll_get_hourlyrate`(salarys) *  1.69 + TIME_TO_SEC(rot_hrs) / 60)
							FROM
								payroll_overtimerequest
							WHERE
								badgenumber = badgenumbers
							AND
								attendance_name = attendance_names
							AND
								DATE_FORMAT(rot_in,'%Y-%m-%d') = gen_date
						)
						ELSE 0
					END
				FROM
					payroll_new_attendance
				WHERE
					badgenumber = badgenumbers
				AND
					hd_status = 1
				AND
					time_in IS NOT NULL
				AND
					time_out IS NOT NULL
				AND
					attendance_name = attendance_names);
	ELSEIF in_holidaytype = 1 THEN
	
		SET holidayot = (SELECT
				CASE 
					WHEN COUNT(id) > 0  THEN 
						(SELECT 
							SUM(`payroll_get_hourlyrate`(salarys) * 2.60 + TIME_TO_SEC(rot_hrs) / 60)
							FROM
								payroll_overtimerequest
							WHERE
								badgenumber = badgenumbers
							AND
								attendance_name = attendance_names
							AND
								DATE_FORMAT(rot_in,'%Y-%m-%d') = gen_date
						)
						ELSE 0
					END
				FROM
					payroll_new_attendance
				WHERE
					badgenumber = badgenumbers
				AND
					hd_status = 1
				AND
					time_in IS NOT NULL
				AND
					time_out IS NOT NULL
				AND
					attendance_name = attendance_names);
	END IF;
RETURN holidayot;
    END */$$
