/* Function  structure for function  `payroll_taxable_income` */

/*!50003 DROP FUNCTION IF EXISTS `payroll_taxable_income` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `payroll_taxable_income`(badgenumbers varchar(100),attendance_names varchar(100)) RETURNS decimal(18,3)
BEGIN
	DECLARE taxable_income DECIMAL(18,3);
	DECLARE gross_income DECIMAL(18,3);
	DECLARE sss DECIMAL(18,3);
	DECLARE pagibig DECIMAL(18,3);
	DECLARE philhealth DECIMAL(18,3);
	
	SET gross_income = ( SELECT payroll_grossincome(badgenumbers,attendance_names));
	SET sss	 	 = (	
				SELECT
					DISTINCT payroll_sss_contribution(salary)/payroll_getnoofpayperiod(badgenumber)
				FROM
					ess_db.`payroll_new_attendance`
				WHERE
					badgenumber = badgenumbers
				AND
					attendance_name = attendance_names
			    );
			    
	SET pagibig 	 = ( 
				SELECT
					DISTINCT payroll_hdmfpagibig_contribution (salary) /payroll_getnoofpayperiod(badgenumbers)
				FROM
					ess_db.`payroll_new_attendance`
				WHERE
					badgenumber = badgenumbers
				AND
					attendance_name = attendance_names
				);
	
	
	SET philhealth	 	 = (	
				SELECT
					DISTINCT payroll_philhealth_contribution(salary)/payroll_getnoofpayperiod(badgenumber)
				FROM
					ess_db.`payroll_new_attendance`
				WHERE
					badgenumber = badgenumbers
				AND
					attendance_name = attendance_names
			    );
			    
	
	
	SET taxable_income = gross_income - sss - pagibig - philhealth;
	
	
	
	RETURN taxable_income;
    END */$$
DELIMITER ;

