DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `payroll_total_holidays`(in_badgenumber VARCHAR(200),
				in_attendancename VARCHAR(100)
    
    ) RETURNS decimal(18,2)
BEGIN
		DECLARE TotRegHoliday DECIMAL(18,2);
		DECLARE TotSpeHoliday DECIMAL(18,2);
		DECLARE TotHoliday DECIMAL(18,2);
		
		
		SET TotRegHoliday = (SELECT SUM(a.holiday_regular) FROM payroll_new_attendance a WHERE a.badgenumber = in_badgenumber AND a.attendance_name = in_attendancename);
		SET TotSpeHoliday = (SELECT SUM(b.holiday_specialnonworking) FROM payroll_new_attendance b WHERE b.badgenumber = in_badgenumber AND b.attendance_name = in_attendancename);
		SET TotHoliday = TotRegHoliday + TotSpeHoliday;
		
	    
		RETURN TotHoliday;
 
	END */$$
