DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `payroll_total_incentives`(badgenumbers VARCHAR(200),attendance_names VARCHAR(100)
    ) RETURNS decimal(18,2)
BEGIN
    
    	DECLARE totalincentives DECIMAL(18,3);
	DECLARE incentives DECIMAL(18,3);
	DECLARE incentivesdeduct DECIMAL(18,3);
	
	
	SET incentives = (SELECT SUM(incentive_amount) FROM payroll_generated_incentives WHERE in_typecalc = 1 and  badgenumber = badgenumbers AND attendance_name = attendance_names );
	SET incentivesdeduct = (SELECT SUM(incentive_amount) FROM payroll_generated_incentives WHERE in_typecalc = 2 and badgenumber = badgenumbers AND attendance_name = attendance_names );
			    
			    
			    
			    
			    
			    
	SET totalincentives    =  IFNULL(incentives,0.00) - IFNULL(incentivesdeduct,0.00);
	RETURN totalincentives;
	
    END */$$
DELIMITER ;

/* Function  structure for function  `payroll_total_leave` */

/*!50003 DROP FUNCTION IF EXISTS `payroll_total_leave` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `payroll_total_leave`(badgenumbers VARCHAR(100), attendance_names VARCHAR(100) ) RETURNS decimal(18,2)
BEGIN
DECLARE chekifhaveleave INT;
	DECLARE leavetotal DECIMAL(18,3);
	DECLARE totalleaveamnt DECIMAL(18,3);
	
	
	
	SET chekifhaveleave = ( SELECT COUNT(id) FROM payroll_leave_history WHERE badgenumber = badgenumbers AND attendance_name = attendance_names );
	SET totalleaveamnt = (
				SELECT new_payroll_get_perday( 
					(SELECT salary FROM users WHERE badgenumber = badgenumbers ) ,
					(SELECT w_satworkdingday FROM users WHERE badgenumber = badgenumbers) * (SELECT SUM(a.total_days) FROM payroll_leave_history a WHERE a.badgenumber = badgenumbers AND a.attendance_name = attendance_names), 
					(SELECT payperiod FROM users WHERE badgenumber = badgenumbers)
					) 
	
				);
    
	IF chekifhaveleave = 0 THEN
		SET leavetotal = 0.00;
	ELSE
		SET leavetotal = totalleaveamnt;
		
	END IF;
	
	
	RETURN ROUND(leavetotal,2);
    END */$$
DELIMITER ;

