/* Function  structure for function  `payroll_ytdf_gross_income` */

/*!50003 DROP FUNCTION IF EXISTS `payroll_ytdf_gross_income` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `payroll_ytdf_gross_income`(badgenumbers VARCHAR(100),attendance_names VARCHAR(100)) RETURNS decimal(18,3)
BEGIN
	DECLARE yearlygross DECIMAL(18,3);
	declare earningamnt decimal(18,2);
	dECLARE deductamnt DECIMAL(18,2);
	
	set earningamnt = (SELECT CASE WHEN SUM(amount) IS NULL THEN 0.00
	ELSE SUM(amount) 
	END 
	from  payroll_add_ajustment where badgenumber = badgenumbers and attendance_name = attendance_names and type = 1);
	
	set deductamnt = (SELECT CASE WHEN SUM(amount) IS NULL THEN 0.00
	ELSE SUM(amount) 
	END
	FROM  payroll_add_ajustment WHERE badgenumber = badgenumbers AND attendance_name = attendance_names AND TYPE = 2);
	
	SET yearlygross = (	
				SELECT
					SUM(a.gross_income) + earningamnt - deductamnt - payroll_total_loans(badgenumbers,attendance_names)
				FROM
					ess_db.`payroll_yeartodatefigures` a
				WHERE
					a.badgenumber = badgenumbers
				AND
					DATE_FORMAT(a.pay_period,'%Y') = DATE_FORMAT(NOW(),'%Y')
				AND
					a.pay_period <=  payroll_get_attendancedate(badgenumbers,attendance_names)
				);
	RETURN yearlygross;
    END */$$
DELIMITER ;

/* Function  structure for function  `payroll_ytdf_netpay` */

