/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `payroll_ytdf_netpay`(badgenumbers VARCHAR(100),attendance_names VARCHAR(100)) RETURNS decimal(18,3)
BEGIN
		DECLARE yearly_netpay DECIMAL(18,3);
		DECLARE earningamnt DECIMAL(18,2);
