/* Function  structure for function  `pay_rep_pay_summary_absences` */

/*!50003 DROP FUNCTION IF EXISTS `pay_rep_pay_summary_absences` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `pay_rep_pay_summary_absences`(in_badgenumber varchar(100), in_genstartdate date, in_month_daystart varchar(100),  in_month_dayend varchar(100)) RETURNS decimal(18,2)
BEGIN
	declare totalabsent decimal(18,2);
	
	set totalabsent = (
			SELECT 
				SUM(CASE 
					WHEN bb.rd_status = 0 
					AND bb.hd_status = 0
					AND bb.leave_status = 0 
					AND bb.suspended_status = 0
					AND bb.late_status = 0 
					AND bb.time_in IS NULL 
					AND bb.time_out IS NULL
				 THEN payroll_get_hourlyrate(bb.salary)*8
				 
				 END )
			    FROM
				payroll_new_attendance bb
			    WHERE
				bb.`badgenumber` = in_badgenumber
			    AND
				bb.gen_date  BETWEEN CONCAT(YEAR(in_genstartdate),in_month_daystart)  AND CONCAT(YEAR(in_genstartdate),in_month_dayend) 
			    AND
				bb.payroll_status = 1
	
				);
	
	return totalabsent;
    END */$$
DELIMITER ;

