/* Function  structure for function  `pos_code_availabilty` */

/*!50003 DROP FUNCTION IF EXISTS `pos_code_availabilty` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `pos_code_availabilty`(getCode VARCHAR(100)) RETURNS varchar(100) CHARSET utf8mb4
BEGIN
DECLARE getType VARCHAR(100);
		DECLARE getMealCode VARCHAR(100);
		DECLARE getBarcode VARCHAR(100);
		
			
		DECLARE countMealCode INT;
		DECLARE countBarcode INT;
	
		DECLARE mealQuantity INT;
		DECLARE itemQuantity INT;
		
		DECLARE mealmaxStock INT;
		DECLARE itemmaxStock INT;
	-- 	
		SET countMealCode = (SELECT COUNT(meal_code) FROM pos_table_mealoftheday WHERE meal_code = getCode);
		SET countBarcode = (SELECT COUNT(barcode) FROM pos_table_items WHERE barcode = getCode);
		
		SET mealQuantity = (SELECT meal_qty FROM pos_table_mealoftheday WHERE meal_code = getCode);
		SET itemQuantity = (SELECT quantity FROM pos_table_items WHERE barcode = getCode);
		
		SET mealmaxStock = (SELECT minimum_stock_alert FROM pos_table_mealoftheday WHERE meal_code = getCode);
		SET itemmaxStock = (SELECT minimum_stock_alert FROM pos_table_items WHERE barcode = getCode );
			
			
		IF countMealCode = 0 THEN
		
			IF itemQuantity = 0 THEN
				SET  getType = 'Item Out of Stock.';
			ELSEIF  itemQuantity <= itemmaxStock THEN 
				SET getType = CONCAT('Item will be out of stock soon. Remaining', itemQuantity);
			ELSEIF itemQuantity >= itemmaxStock THEN
				SET getType = '';
			ELSE
				SET getType = 'Invalid Barcode Or Meal Code.';
			END IF;
			
		ELSE
			IF mealQuantity = 0 THEN
				SET  getType = 'Meal Out of Stock.';
			ELSEIF  mealQuantity <= mealmaxStock THEN 
				SET getType = CONCAT(getCode,' Remaining Meal ', mealQuantity );
			ELSEIF mealQuantity >= mealmaxStock THEN
				SET getType = '';
			ELSE
				SET getType = 'System Error Please Contact Developers.';
			END IF;
		END IF;
		
		-- 
		RETURN getType;
    END */$$
DELIMITER ;

