/* Procedure structure for procedure `new_payroll_add_incentives_perdep` */

/*!50003 DROP PROCEDURE IF EXISTS  `new_payroll_add_incentives_perdep` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `new_payroll_add_incentives_perdep`(
			IN in_id INT,
			IN in_action VARCHAR(20),
			IN in_attendancename VARCHAR(100),
			IN in_department_id INT,
			IN in_incentive_id INT,
			IN in_typecalc int,
			IN in_inamount DECIMAL(18,2),
			IN in_added_by VARCHAR(200)
		)
BEGIN
	DECLARE countExistincentive INT;
	SET countExistincentive = (SELECT COUNT(id) FROM  `payroll_incentives` WHERE incentive_id = in_incentive_id AND group_tag = in_department_id AND attendance_name = in_attendancename );
		
	IF in_action = 'ADD' THEN
	
		IF in_department_id = '' THEN
			
			SELECT 'error' AS message_success , 'Error Found' AS message_title, 'Department is Required.' AS message_body;
			
		ELSEIF in_incentive_id = '' THEN
	
			SELECT 'error' AS message_success , 'Error Found' AS message_title, 'Incentive is Required.' AS message_body;
	
	
		ELSEIF in_inamount = '' THEN
		
			SELECT 'error' AS message_success , 'Error Found' AS message_title, 'Amount is Required.' AS message_body;
			
		ELSEIF in_typecalc = '' THEN
		
			SELECT 'error' AS message_success , 'Error Found' AS message_title, 'Please select Type' AS message_body;	
	
		
		ELSE
			
			IF countExistincentive > 0 THEN
				
				SELECT 'error' AS message_success , 'Error Found' AS message_title, 'Incentive is already included.' AS message_body;
		
			ELSE
			
				
				SELECT r.badgenumber, in_attendancename, in_typecalc, r.department, r.grouptag, in_incentive_id, in_inamount, in_added_by
				FROM `tbl_incentives_for_generated_payroll` r
				WHERE 
				r.attendance_name = in_attendancename
				AND r.grouptag = in_department_id ;
				
				SELECT 'success' AS message_success , 'Success' AS message_title, 'Incentive successfully Included' AS message_body;
			END IF;
		END IF;
	
	ELSEIF in_action = 'DELETE' THEN
	
		DELETE FROM payroll_incentives WHERE id = in_id;
		
		SELECT 'success' AS message_success , 'Success' AS message_title, 'Remove Succesfully' AS message_body;
		
	ELSEIF in_action = 'UPDATE' THEN
	
		IF in_inamount = '' THEN 
		
			SELECT 'error' AS message_success , 'Error Found' AS message_title, 'Amount is Required' AS message_body;
		
		ELSE 
			UPDATE payroll_incentives SET incentive_amount = in_inamount WHERE id = in_id ;
			
			SELECT 'success' AS message_success , 'Success' AS message_title, 'Amount Succesfully Updated.' AS message_body;
		END IF;
		
		SELECT 'success' AS message_success , 'Success' AS message_title, 'Remove Succesfully' AS message_body;
	
	ELSE 
	
		SELECT 'error' AS message_success , 'Error Found' AS message_title, 'Please Reload The Page' AS message_body;
	
	
	END IF;
	
	
	
		
END */$$
DELIMITER ;

/* Procedure structure for procedure `new_payroll_employee_loan` */

/*!50003 DROP PROCEDURE IF EXISTS  `new_payroll_employee_loan` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `new_payroll_employee_loan`(
    
							in in_id int,
							in in_action varchar(20),
							in in_badgenumber varchar(100),
							in in_loan_type_id int,
							in in_amount decimal(18,3),
							in in_monthstopay int,
							in in_date_start date,
							in in_action_by varchar(50),
							in in_status int 
						)
BEGIN
		
		declare checkifloandone int;
		DECLARE employeecompid INT;
		
		set checkifloandone = (SELECT COUNT(id) FROM payroll_employee_loan WHERE badgenumber = in_badgenumber  AND STATUS not in ('3'));
		set employeecompid = (SELECT company_id FROM users WHERE badgenumber = in_badgenumber);
		
		
		if in_action = 'ADD' THEN 
		
			if checkifloandone > 0 then
				SELECT 'error' AS message_success , 'Error While Saving' AS message_title, 'Cant Apply Loan When Theres An active Loan Type' AS message_body;
			
			elseif in_date_start < date(now()) then
				SELECT 'error' AS message_success , 'Error While Saving' AS message_title, 'Date Already Passed' AS message_body;
			else
				
				
				SELECT 'success' AS message_success , 'Success' AS message_title, 'Successfully Added Employee Loan' AS message_body;
			
			end if;
			
		elseif in_action = 'EDIT' THEN
			
			UPDATE 
				payroll_employee_loan 
			SET 
				
				loan_type_id = in_loan_type_id,
				amount = in_amount,
				months_to_pay = in_monthstopay,
				balance = in_amount,
				start_date = in_date_start,
				deductpermonth = in_amount/ months_to_pay,
				end_date =  DATE_ADD(in_date_start, INTERVAL in_monthstopay MONTH) - INTERVAL 1 DAY,
				update_by = in_action_by
			where
				id = in_id;
			
			SELECT 'success' AS message_success , 'Success' AS message_title, 'Successfully Update' AS message_body;
			
		elseif in_action= 'DELETE' THEN
			update payroll_employee_loan set
			
			delete_by = in_action_by 
			where id = in_id;
			
			delete  FROM payroll_employee_loan WHERE id = in_id;
			
						
			SELECT 'success' AS message_success , 'Success' AS message_title, 'Successfully Remove' AS message_body;
			
		ELSEIF in_action= 'ACTIVATE' THEN
		
			IF checkifloandone > 0 THEN
				SELECT 'error' AS message_success , 'Error Found !!!' AS message_title, 'Cant Accept While This an active loan' AS message_body;
			
			else
				
				UPDATE payroll_employee_loan SET
				
				
				status = 1 , update_by = in_action_by
				WHERE id = in_id;
					
				SELECT 'success' AS message_success , 'Success' AS message_title, 'Successfully Mark As Active' AS message_body;
			
			end if;	
			
		
		ELSEIF in_action= 'PAUSE' THEN
		
		
			UPDATE payroll_employee_loan SET
			
			
			STATUS = 2 , update_by = in_action_by
			WHERE id = in_id;
				
			SELECT 'success' AS message_success , 'Success' AS message_title, 'Successfully Mark As Pause' AS message_body;
		
			
		
		end if;
		
		
	END */$$
DELIMITER ;

/* Procedure structure for procedure `new_payroll_lock` */

/*!50003 DROP PROCEDURE IF EXISTS  `new_payroll_lock` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `new_payroll_lock`(
					IN in_attendance_name VARCHAR(100)
				)
BEGIN
	
		DECLARE in_gen_from DATE ;
		DECLARE in_gen_to DATE ;
		SET in_gen_from = (SELECT date_from FROM payroll_generated_attendance WHERE attendance_name =in_attendance_name );
		SET in_gen_to = (SELECT date_to FROM payroll_generated_attendance WHERE attendance_name =in_attendance_name );
	
	
	

		SELECT 
			a.badgenumber,  
			a.attendance_name, 
			a.intype ,
			(SELECT r.department_name FROM `tbl_department` r  WHERE r.department_id = a.department_id ),
			(SELECT s.incentives_name FROM `tbl_setup_incentives` s WHERE s.id = a.incentive_id),
			a.incentive_amount,
			a.`badgenumber`,
			a.added_date
			
		FROM 
		   payroll_incentives a
		WHERE
		   a.`attendance_name` = in_attendance_name;	
	
	
		UPDATE pos_table_debt SET inStatus = 'payed' WHERE date_of_transaction BETWEEN in_gen_from AND in_gen_to; 
                                                              badgenumber,
                                                                attendance_name,
                                                                pay_period,
                                                                sss,
                                                                pagibig,
                                                                philhealth,
                                                                gross_income,
                                                                taxable_income,
                                                                net_pay,
                                                                attendance_start,
                                                                attendance_end,
                                                                philhealthno,
                                                                sssno,
                                                                pagibigno,
                                                                lastname,
                                                                firstname,
                                                                middlename,
                                                                suffix,
                                                                department_id,
                                                                department_name,
                                                                payperiod,
								ytd_gross_income,
							 	ytd_taxable_income,
								ytd_netpay
                                                                )
                                SELECT
                                    badgenumber,
                                    attendance_name,
                                    DATE_FORMAT(date_added,'%Y-%m-%d'),
                                    deduct_sss/payperiod,
                                    deduct_pagibig/payperiod,
                                    deduct_philhealth/payperiod,
                                    payroll_grossincome(badgenumber,attendance_name),
                                    payroll_taxable_income(badgenumber,attendance_name),
                                    payroll_taxable_income(badgenumber,attendance_name) - payroll_get_wholdingtax2(a.salary,payperiod) - payroll_canteenDeduct(a.badgenumber,a.attendance_name) - payroll_total_loans(a.badgenumber, a.attendance_name)  +  payroll_total_incentives(a.badgenumber,a.attendance_name),
                                    in_gen_from,
                                    in_gen_to,
                                    philhealth_no,
                                    gsis_bp_no,
                                    pagibig_no,
                                    lastname,
                                    firstname,
                                    middlename,
                                    suffix,
                                    department_id,
                                    department_name,
                                    payperiod,
				   (SELECT IFNULL(SUM(ytd_gross_income),0.00) FROM payroll_yeartodatefigures WHERE badgenumber = a.badgenumber  AND YEAR(pay_period) = YEAR(in_gen_from)) +
					   CASE 
						WHEN payroll_grossincome(a.badgenumber,a.attendance_name) < 0 THEN 0.00
						ELSE payroll_grossincome(a.badgenumber,a.attendance_name)
					   END,
                                   (SELECT IFNULL(SUM(ytd_taxable_income),0.00) FROM payroll_yeartodatefigures WHERE badgenumber = a.badgenumber AND YEAR(pay_period) = YEAR(in_gen_from)) + 
					   CASE 
						WHEN  payroll_taxable_income(a.badgenumber,a.attendance_name) < 0 THEN 0.00
						ELSE payroll_taxable_income(a.badgenumber,a.attendance_name)
					   END ,
                                   
                                    (SELECT IFNULL(SUM(ytd_netpay),0.00) FROM payroll_yeartodatefigures WHERE badgenumber = a.badgenumber  AND YEAR(pay_period) = YEAR(in_gen_from)) + 
                                    
					   CASE 
						WHEN payroll_taxable_income(a.badgenumber,a.attendance_name) - payroll_get_wholdingtax2(a.salary, payperiod) - payroll_canteenDeduct(badgenumber,attendance_name) -  payroll_total_loans(a.badgenumber, a.attendance_name) + payroll_total_incentives(a.badgenumber,a.attendance_name)< 0 THEN 0.00
						ELSE payroll_taxable_income(a.badgenumber,a.attendance_name) - payroll_get_wholdingtax2(a.salary, payperiod) - payroll_canteenDeduct(badgenumber,attendance_name) - payroll_total_loans(a.badgenumber, a.attendance_name) + payroll_total_incentives(a.badgenumber,a.attendance_name)
					   END 
                                    
                                FROM
                                    `payroll_new_attendance` a
                                WHERE 
                                    attendance_name = in_attendance_name
                                GROUP BY
                                    badgenumber;
	
	
	
	
		
		DELETE FROM payroll_incentives WHERE attendance_name = in_attendance_name;
		
		ALTER TABLE payroll_incentives AUTO_INCREMENT = 1;
		
		UPDATE payroll_generated_attendance SET isLocked  = 1 WHERE attendance_name = in_attendance_name;
		
		SELECT 'success' AS message_success , 'Success' AS message_title, CONCAT( in_attendance_name,' Succesfully Locked') AS message_body;
			
		
	END */$$
DELIMITER ;

/* Procedure structure for procedure `new_setup_aed_agency` */

/*!50003 DROP PROCEDURE IF EXISTS  `new_setup_aed_agency` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `new_setup_aed_agency`(
						in in_id int,
						in in_action varchar(20),
						in in_agency_name varchar(100),
						in action_by varchar(100)
						)
BEGIN
		declare chkagencyifexist int;
		set chkagencyifexist = (SELECT COUNT(company_id) FROM tbl_company where company_name = in_agency_name );
		
		if in_action = 'ADD' THEN
		
			IF chkagencyifexist > 0 THEN
				SELECT 'error' AS message_success , 'Error Found' AS message_title, CONCAT_WS(' ', in_agency_name ,'Already Exist') AS message_body;
			
			elseif in_agency_name ='' or in_agency_name is null then
			
				SELECT 'error' AS message_success , 'Error Found' AS message_title, CONCAT_WS(' ','Agency Name Is Required') AS message_body;
			
			else
				SELECT 'success' AS message_success , 'Success' AS message_title, CONCAT_WS(' ', in_agency_name ,'Successfully Added') AS message_body;
			
			end if;
		
		elseif in_action = 'EDIT' THEN
		
			IF chkagencyifexist > 0 THEN
				SELECT 'error' AS message_success , 'Error While Saving' AS message_title, CONCAT_WS(' ', in_agency_name ,'Already Exist') AS message_body;
			
			ELSEIF in_agency_name ='' OR in_agency_name IS NULL THEN
			
				SELECT 'error' AS message_success , 'Error Found' AS message_title, CONCAT_WS(' ','Agency Name Is Required') AS message_body;
			
			ELSE
				UPDATE  tbl_company set 
					company_name = in_agency_name,
					update_by = action_by
				where 
					company_id = in_id;
				
				SELECT 'success' AS message_success , 'Success' AS message_title, CONCAT_WS(' ', in_agency_name ,'Successfully Included') AS message_body;
			
			END IF;
		
		END IF;
		
	END */$$
DELIMITER ;

