/* Procedure structure for procedure `sp_approve_late` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_approve_late` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_approve_late`(IN method varchar(255),
							       IN in_late_id INT, 
							       IN user_id INT
						               )
BEGIN
	
	
	
	DECLARE EXIT HANDLER FOR 1062
	SELECT 'Record Already Exist' AS message ,'info' AS class;
	
	IF method = 'APPROVE' THEN
		UPDATE tbl_ta_late 
			SET 
				late_status 	 		= '1',
				late_status_name		= 'Approved',
				Approved_by			= (SELECT CONCAT_WS(' ',(SELECT CONCAT_WS(',',`ess_db`.`users`.`firstname`,
													      `ess_db`.`users`.`middlename`,
													      `ess_db`.`users`.`lastname`
													  )
											 FROM `ess_db`.`users`
											 WHERE `ess_db`.`users`.`employee_id` = user_id),
											 CURRENT_TIMESTAMP()
											 
									            )
								   )
			WHERE
				late_id = in_late_id;
		SELECT 'Record Successfully Update' AS message ,'success' AS class;
		
	 ELSE
		UPDATE tbl_ta_late 
			SET 
				late_status 	 		= '2',
				late_status_name		= 'Rejected',
				Approved_by			= (SELECT CONCAT_WS(' ',(SELECT CONCAT_WS(',',`ess_db`.`users`.`firstname`,
													      `ess_db`.`users`.`middlename`,
													      `ess_db`.`users`.`lastname`
													  )
											 FROM `ess_db`.`users`
											 WHERE `ess_db`.`users`.`employee_id` = user_id),
											 CURRENT_TIMESTAMP()
											 
									            )
								   )
			WHERE
				late_id = in_late_id;
		SELECT 'Record Successfully Update' AS message ,'success' AS class;
         END IF;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_approve_status_InOut` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_approve_status_InOut` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_approve_status_InOut`(IN method varchar(255),
							       IN r_time_id INT, 
							       IN r_user_id INT,
						               IN r_remarks VARCHAR(255)
						               )
BEGIN
	
	
	
	DECLARE EXIT HANDLER FOR 1062
	SELECT 'Record Already Exist' AS message ,'info' AS class;
	
	IF method = 'APPROVE' THEN
		SELECT request_user_id,request_check_time,request_type,'1' AS verifycode,'333' AS SN
		FROM ess_db.tbl_time_attendance_request 
		WHERE request_time_id = r_time_id;
		
		UPDATE tbl_time_attendance_request 
			SET 
				request_remarks 		= '',
				request_status			= '1',
				updated_by			= r_user_id,
				updated_date			= CURRENT_TIMESTAMP()
			WHERE
				request_time_id = r_time_id;
		SELECT 'Record Successfully Added' AS message ,'success' AS class;
		
	 ELSE
		UPDATE tbl_time_attendance_request 
			SET 
				request_remarks 		= r_remarks,
				request_status			= '2',
				updated_by			= r_user_id,
				updated_date			= CURRENT_TIMESTAMP()
			WHERE
				request_time_id = r_time_id;
		SELECT 'Record Successfully Updated' AS message, 'success' AS class;
         END IF;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_bt_aed` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_bt_aed` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_bt_aed`( IN method VARCHAR(10),
				     IN in_bt_id INT,
				     IN in_bt_dept INT,
				     IN in_bt_gn INT,
				     IN in_bt_date DATE,
				     IN in_bt_start DATETIME,
				     IN in_bt_end DATETIME,
				     IN in_user_id INT
				   )
BEGIN
		DECLARE in_bt_time TIME;	
		DECLARE EXIT HANDLER FOR 1062
		BEGIN
			SELECT CONCAT('This Shift Name is Already Exist (',in_bt_date,')') AS message, 'info' AS class;
			
		END;
		
		BEGIN
		IF DATE_FORMAT(in_bt_start,'%Y-%m-%d') != DATE_FORMAT(in_bt_end,'%Y-%m-%d') THEN
			SET in_bt_time = ABS(TIMEDIFF(in_bt_end,in_bt_start));
		ELSE
			SET in_bt_time = ABS(TIMEDIFF(in_bt_start,in_bt_end));
		END IF;
		END;
		CASE 
			WHEN method = 'ADD' THEN	
								 bt_gn,
								 bt_date,
								 bt_start,
								 bt_end,
								 bt_time,
								 `status`,
								 created_by,
								 created_date
								 )
			VALUES(
				 in_bt_dept,
				 in_bt_gn,
				 in_bt_date,
				 in_bt_start,
				 in_bt_end,
				 in_bt_time,
				 '1',
				 in_user_id,
				CURRENT_TIMESTAMP
			       );
			     SELECT 'New Record Successfully Added' AS message , 'success' AS class;
			WHEN method = 'EDIT' THEN
				UPDATE tbl_time_attendance_bt
				SET
				    bt_dept		= in_bt_dept,
				    bt_gn		= in_bt_gn,
				    bt_date		= in_bt_date,
				    bt_start		= in_bt_start,
				    bt_end		= in_bt_end,
				    bt_time		= in_bt_time,
				    `status` 	 	= '1',
				    updated_by          = in_user_id,
				    updated_date        = CURRENT_TIMESTAMP
				WHERE 
				     bt_id = in_bt_id;
				SELECT 'Record Successfully Updated' AS message , 'success' AS class;
						
			ELSE
				UPDATE tbl_time_attendance_bt
				SET
				    `status`		= '0',
				    updated_by          = in_user_id,
				    updated_date        = CURRENT_TIMESTAMP
				WHERE 
				     bt_id = in_bt_id;
				SELECT 'Record Successfully Deleted' AS message , 'success' AS class;
		END CASE;
	END */$$
DELIMITER ;

