DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_compute_late_range`(IN date_from DATE, IN date_to date)
BEGIN
		SELECT 
			DISTINCT(a.badgenumber),
			(SELECT CONCAT_WS(', ',lastname,firstname,middlename,suffix) FROM ess_db.users WHERE badgenumber = a.badgenumber) AS `name`,
			(SELECT 
				SUM(late_status) 
			 FROM 
				ess_db.vw_timerecords 
			 WHERE 
				badgenumber = a.badgenumber AND gen_date BETWEEN date_from AND date_to) AS `total_late`
		FROM 
			ess_db.vw_timerecords a
		WHERE 
			gen_date BETWEEN date_to AND date_to 
			ORDER BY total_late DESC;
	END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_countlate` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_countlate` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_countlate`(IN user_id int ,IN date_from DATE,IN date_to DATE)
BEGIN
	SELECT 
		COUNT(*) AS late_count
	FROM   
		ess_db.vw_base_on_schedule_time_in
	WHERE  
		employee_id = user_id AND 
		gen_date BETWEEN date_from AND date_to AND 
		color = 'red';
