/* Procedure structure for procedure `sp_create_date_range` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_create_date_range` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_create_date_range`(IN date_from date,IN date_to date)
BEGIN
		TRUNCATE TABLE tbl_temp_range_date;
		SELECT gen_date,WEEKDAY(gen_date)
		 FROM
		(SELECT ADDDATE('1970-01-01',t4*10000 + t3*1000 + t2*100 + t1*10 + t0) gen_date FROM
		(SELECT 0 t0 UNION SELECT 1 UNION SELECT 2 UNION SELECT 3 UNION SELECT 4 UNION SELECT 5 UNION SELECT 6 UNION SELECT 7 UNION SELECT 8 UNION SELECT 9) t0,
		(SELECT 0 t1 UNION SELECT 1 UNION SELECT 2 UNION SELECT 3 UNION SELECT 4 UNION SELECT 5 UNION SELECT 6 UNION SELECT 7 UNION SELECT 8 UNION SELECT 9) t1,
		(SELECT 0 t2 UNION SELECT 1 UNION SELECT 2 UNION SELECT 3 UNION SELECT 4 UNION SELECT 5 UNION SELECT 6 UNION SELECT 7 UNION SELECT 8 UNION SELECT 9) t2,
		(SELECT 0 t3 UNION SELECT 1 UNION SELECT 2 UNION SELECT 3 UNION SELECT 4 UNION SELECT 5 UNION SELECT 6 UNION SELECT 7 UNION SELECT 8 UNION SELECT 9) t3,
		(SELECT 0 t4 UNION SELECT 1 UNION SELECT 2 UNION SELECT 3 UNION SELECT 4 UNION SELECT 5 UNION SELECT 6 UNION SELECT 7 UNION SELECT 8 UNION SELECT 9) t4) v
		WHERE gen_date BETWEEN date_from AND date_to;
	END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_css_aed` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_css_aed` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_css_aed`( IN method VARCHAR(10),
					     IN in_css_id INT,
					     IN in_shift_name varchar(100),
					     IN in_wk_0 INT,
					     IN in_wk_1 INT,
					     IN in_wk_2 INT,
					     IN in_wk_3 INT,
					     IN in_wk_4 INT,
					     IN in_wk_5 INT,
					     IN in_wk_6 INT,
					     IN in_wk_group INT,
					     IN in_employee_id int
						)
BEGIN
		-- exit if the duplicate key occurs
		DECLARE EXIT HANDLER FOR 1062
		BEGIN
			SELECT CONCAT('This Shift Name is Already Exist (',in_shift_name,')') AS message, 'info' as class;
		END;
		CASE 
			WHEN method = 'ADD' THEN
								 wk_0,
								 wk_1,
								 wk_2,
								 wk_3,
								 wk_4,
								 wk_5,
								 wk_6,
								 wk_status,
								 wk_group,
								 created_by,
								 created_date
								 )
			VALUES(in_shift_name,
				in_wk_0,
				in_wk_1,
				in_wk_2,
				in_wk_3,
				in_wk_4,
				in_wk_5,
				in_wk_6,
				'1',
				in_wk_group,
				in_employee_id,
				CURRENT_TIMESTAMP
			       );
			     SELECT CONCAT('New Record Successfully Added (',in_shift_name,')') AS message , 'success' AS class;
			WHEN method = 'EDIT' THEN
				UPDATE tbl_time_attendance_custom_shift 
				SET
				    css_shift_name      = in_shift_name,
				    wk_0                = in_wk_0,
				    wk_1                = in_wk_1,
				    wk_2                = in_wk_2,
				    wk_3                = in_wk_3,
				    wk_4                = in_wk_4,
				    wk_5                = in_wk_5,
				    wk_6                = in_wk_6,
				    wk_status		= '1',
				    wk_group		= in_wk_group,
				    updated_by          = in_employee_id,
				    updated_date        = CURRENT_TIMESTAMP
				WHERE 
				     css_id = in_css_id;
				SELECT CONCAT('Record Successfully Updated (',in_shift_name,')') AS message , 'success' AS class;
						
			ELSE
				UPDATE tbl_time_attendance_custom_shift 
				SET
					    wk_status		= '0',
					    updated_by          = in_employee_id,
					    updated_date        = current_timestamp
				WHERE 
					    css_id = in_css_id;
				SELECT CONCAT('Record Successfully Deleted (',in_shift_name,')') AS message , 'success' AS class;
		END CASE;
	END */$$
DELIMITER ;

