DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_dss_aed`( IN method varchar(10),
				     IN in_wk_id INT,
				     IN in_department_id int,
				     IN in_wk_0 INT,
				     IN in_wk_1 INT,
				     IN in_wk_2 INT,
				     IN in_wk_3 INT,
				     IN in_wk_4 INT,
				     IN in_wk_5 INT,
				     IN in_wk_6 INT,
				     IN in_wk_valid_from DATE,
				     IN in_wk_valid_to DATE,
				     IN in_wk_group INT,
				     IN in_employee_id INT
				   )
BEGIN
		DECLARE checking_date INT;
		DECLARE value_from DATE;
		DECLARE value_to DATE;
		
		SET value_from = (SELECT 
					wk_valid_from 
				  FROM 
					tbl_time_attendance_per_week
				  WHERE 
					department_id = in_department_id AND
					wk_group   = in_wk_group AND
					wk_status = '1'
					ORDER BY wk_id DESC LIMIT 1);
					 
		SET value_to   = (SELECT 
					wk_valid_to 
				  FROM 
					tbl_time_attendance_per_week
				  WHERE 
					department_id = in_department_id AND
					wk_group   = in_wk_group AND
					wk_status = '1'
					ORDER BY wk_id DESC LIMIT 1);
		
		CREATE TEMPORARY TABLE IF NOT EXISTS temp_dss(
			ID INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
			SCHEDULE_DATE DATE);
		
		SELECT 
			SCHEDULE_DATE
		FROM
			(SELECT ADDDATE('1970-01-01',t4*10000 + t3*1000 + t2*100 + t1*10 + t0) SCHEDULE_DATE FROM
			(SELECT 0 t0 UNION SELECT 1 UNION SELECT 2 UNION SELECT 3 UNION SELECT 4 UNION SELECT 5 UNION SELECT 6 UNION SELECT 7 UNION SELECT 8 UNION SELECT 9) t0,
			(SELECT 0 t1 UNION SELECT 1 UNION SELECT 2 UNION SELECT 3 UNION SELECT 4 UNION SELECT 5 UNION SELECT 6 UNION SELECT 7 UNION SELECT 8 UNION SELECT 9) t1,
			(SELECT 0 t2 UNION SELECT 1 UNION SELECT 2 UNION SELECT 3 UNION SELECT 4 UNION SELECT 5 UNION SELECT 6 UNION SELECT 7 UNION SELECT 8 UNION SELECT 9) t2,
			(SELECT 0 t3 UNION SELECT 1 UNION SELECT 2 UNION SELECT 3 UNION SELECT 4 UNION SELECT 5 UNION SELECT 6 UNION SELECT 7 UNION SELECT 8 UNION SELECT 9) t3,
			(SELECT 0 t4 UNION SELECT 1 UNION SELECT 2 UNION SELECT 3 UNION SELECT 4 UNION SELECT 5 UNION SELECT 6 UNION SELECT 7 UNION SELECT 8 UNION SELECT 9) t4) v
		WHERE 
			SCHEDULE_DATE BETWEEN value_from AND value_to;
			
		SET checking_date = (SELECT COUNT(*) FROM temp_dss WHERE SCHEDULE_DATE BETWEEN in_wk_valid_from AND in_wk_valid_from);
		
		CASE 
		
			WHEN method = 'ADD' THEN
				IF(checking_date > 0) THEN
					SELECT CONCAT('This Department Shift Schedule is Already Exist') AS message, 'info' AS class;
				ELSE
										 wk_0,
										 wk_1,
										 wk_2,
										 wk_3,
										 wk_4,
										 wk_5,
										 wk_6,
										 wk_valid_from,
										 wk_valid_to,
										 wk_status,
										 wk_group,
										 created_by,
										 created_date
										 )
					VALUES(in_department_id,
						in_wk_0,
						in_wk_1,
						in_wk_2,
						in_wk_3,
						in_wk_4,
						in_wk_5,
						in_wk_6,
						in_wk_valid_from,
						in_wk_valid_to,
						'1',
						in_wk_group,
						in_employee_id,
						CURRENT_TIMESTAMP
					       );
					     SELECT 'New Record Successfully Added' as message , 'success' as class;
				END IF;
			WHEN method = 'EDIT' THEN
				UPDATE tbl_time_attendance_per_week 
				SET
				    department_id       = in_department_id,
				    wk_0                = in_wk_0,
				    wk_1                = in_wk_1,
				    wk_2                = in_wk_2,
				    wk_3                = in_wk_3,
				    wk_4                = in_wk_4,
				    wk_5                = in_wk_5,
				    wk_6                = in_wk_6,
				    wk_valid_from       = in_wk_valid_from,
				    wk_valid_to         = in_wk_valid_to,
				    wk_group		= in_wk_group,
				    updated_by          = in_employee_id,
				    updated_date        = current_timestamp
				WHERE 
				     wk_id = in_wk_id;
				SELECT 'Record Successfully Updated' AS message , 'success' AS class;
						
			ELSE
				UPDATE tbl_time_attendance_per_week 
				SET
				    wk_status		= '0',
				    updated_by          = in_employee_id,
				    updated_date        = CURRENT_TIMESTAMP
				WHERE 
				     wk_id = in_wk_id;
				SELECT 'Record Successfully Deleted' AS message , 'success' AS class;
		END CASE;
		DROP TEMPORARY TABLE temp_dss;
	END */$$
DELIMITER ;

