						in_wk_valid_to,
						'1',
						in_user_id,
						CURRENT_TIMESTAMP
					       );
					     SELECT 'New Record Successfully Added' AS message , 'success' AS class;
				END IF;
			WHEN method = 'EDIT' THEN
				UPDATE tbl_time_attendance_per_week_employee 
				SET
