/* Procedure structure for procedure `sp_findleavebalance` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_findleavebalance` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_findleavebalance`()
BEGIN
		DECLARE leavebalance DOUBLE;
		DECLARE dateofregularization DATE;
		DECLARE availablebalance DOUBLE;
		
		SET leavebalance = (SELECT leave_value FROM ess_db.`tbl_leavetypes` where leave_type_id ='1');
		SET dateofregularization = (SELECT MONTH(date_regular) FROM ess_db.`users` WHERE id ='16');
		set availablebalance = leavebalance * dateofregularization;
		
		SELECT availablebalance AS STATUS;
	END */$$
DELIMITER ;

