/* Procedure structure for procedure `sp_n_add_course` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_n_add_course` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_n_add_course`(
						in in_action varchar(10),
						in in_id int,
						in in_degree_id int,
						in in_course_name varchar(100),
						in in_added_by varchar(100),
						in in_update_by varchar(100),
						in in_delete_by varchar(100)
					)
BEGIN
		DECLARE ifexistcourse int;
		set ifexistcourse = (SELECT COUNT(course_name) FROM tbl_education_course WHERE course_name = in_course_name);
	
		if in_action = 'ADD' THEN
			IF in_course_name IS NULL OR in_course_name = '' THEN
				SELECT 'error' AS message_success , 'Error Found' AS message_title, 'Course Name Is Empty.' AS message_body;
			elseif ifexistcourse > 0 then
				SELECT 'error' AS message_success , 'Error Found' AS message_title, 'Course Already Included You Can Refresh the page To Show.' AS message_body;
			
			else
								
				SELECT 'success' AS message_success , 'Save Success' AS message_title, concat(in_course_name,' Succesfully Added') AS message_body;
			end if;
		end if;
	END */$$
DELIMITER ;

