/* Procedure structure for procedure `sp_payroll_save_attendance` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_payroll_save_attendance` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_payroll_save_attendance`(
							IN in_company_id INT,
							IN in_action VARCHAR(50),
							IN in_gen_from DATE,
							IN in_gen_to DATE,
							IN in_createdby VARCHAR(50),
							IN in_attendancename VARCHAR(100),
							IN in_payperiod INT
							)
BEGIN
IF in_action ='DELETE' THEN
	DELETE FROM payroll_incentives WHERE attendance_name = in_attendancename;
	DELETE FROM payroll_new_attendance WHERE attendance_name = in_attendancename;
	DELETE FROM payroll_leave_history WHERE attendance_name = in_attendancename;
	DELETE FROM payroll_generated_attendance_remarks WHERE attendance_name = in_attendancename;
	DELETE FROM payroll_add_ajustment WHERE attendance_name = in_attendancename;
	DELETE FROM payroll_overtimerequest WHERE attendance_name = in_attendancename;
	UPDATE payroll_employee_loan SET balance = balance + (SELECT SUM(paid_amount) FROM payroll_genearated_loans WHERE loan_id = payroll_employee_loan.`id`);
	UPDATE payroll_employee_loan SET STATUS = 1 WHERE balance != 0.00 AND STATUS NOT IN('2','4');
	DELETE FROM payroll_genearated_loans WHERE attendance_name = in_attendancename;
	UPDATE payroll_generated_attendance SET date_deleted = CURRENT_TIMESTAMP(), 
		deleted_by_badgenumber = in_createdby, deleted_by_name = `get_fullname_woutbadge`(in_createdby)
		WHERE attendance_name = in_attendancename;
	DELETE FROM payroll_yeartodatefigures WHERE attendance_name = in_attendancename;
	DELETE FROM  tbl_incentives_for_generated_payroll WHERE attendance_name =in_attendancename;
	DELETE FROM payroll_incentives WHERE attendance_name = in_attendancename;
	DELETE FROM payroll_generated_incentives WHERE attendance_name = in_attendancename;
	DELETE FROM payroll_generated_holiday  WHERE attendance_name = in_attendancename;
	
	SELECT CONCAT_WS(' ', in_attendancename,'Succesfully Deleted') AS message, '1' AS success_message; 
	-- 	
ELSE
		-- ========================================  HOLIDAYS =============================================================
		
		SELECT in_attendancename,  u.hd_id, u.hd_name, u.date_from
		, (SELECT holiday_type_name FROM tbl_holiday_type WHERE id = u.hd_type)
		FROM tbl_time_attendance_holiday u
		WHERE
			CASE 
				WHEN u.hd_recurring = 1 THEN
				(
					SELECT CONCAT( DATE_FORMAT(u.date_from, '%m-%d')) BETWEEN CONCAT( DATE_FORMAT(in_gen_from, '%m-%d') ) AND CONCAT( DATE_FORMAT(in_gen_to, '%m-%d')) 
					AND	
					CONCAT( DATE_FORMAT(u.date_to, '%m-%d')) BETWEEN CONCAT( DATE_FORMAT(in_gen_from, '%m-%d') ) AND CONCAT( DATE_FORMAT(in_gen_to, '%m-%d'))
				)
				
				WHEN u.hd_recurring = 0 THEN
						
				(
					SELECT u.date_from BETWEEN  in_gen_from AND in_gen_to
					AND
					u.date_to BETWEEN in_gen_from AND in_gen_to
				
				)
			END
		AND
			hd_status = 1;
			
		-- ========================================  CLOCK IN AND OUT =============================================================
                        fullname,badgenumber,gender, company_id, fixed_salary, department_id, group_tag,gen_date,schedule_in,schedule_out,time_in,time_out,late,undertime,
                        rd_status,hd_status,leave_status,suspended_status,late_status,absent_status,work_hours,over_break,salary,email,DOB,place_of_birth,
                        civil_status,citizenship,employee_position,position_name,company_name,department_name,section,residential_address,residential_barangay,
                        residential_zipcode,residential_telno,permanent_address,permanent_barangay,permanent_zipcode,permanent_telno,gsis_bp_no,pagibig_no,
                        philhealth_no,agency_emp_no,tin_no, wht_code,bank_account,date_regular,date_contractual,date_added,created_by,attendance_name,card_pos_deduct,
                        deduct_sss, deduct_philhealth, deduct_pagibig, payperiod,lastname, firstname, middlename, suffix,w_satworkdingday
                        )
                    SELECT
                        CONCAT_WS(' ',b.`lastname`,b.`firstname`,b.`middlename`,b.`suffix`) AS fullname,a.`badgenumber`,f.`gender_name`,b.`company_id`, a.fixed_salary, a.`department_id`,
                        a.`group_tag`,a.`gen_date`,a.`schedule_in`,a.`schedule_out`,a.`time_in`,a.`time_out`,a.`late`,a.`undertime`,a.`rd_status`,a.`hd_status`,a.`leave_status`,
                        a.`suspended_status`,a.`late_status`,a.`absent_status`,a.`work_hours`,a.`over_break`, b.`salary`,b.`email`,b.`DOB`,b.`place_of_birth`,b.`civil_status`,
                        b.`citizenship`,b.`employee_position`,d.`position_name`,c.`company_name`,e.`department_name`,b.`section`,b.`residential_address`,b.`residential_barangay`,
                        b.`residential_zipcode`,b.`residential_telno`,b.`permanent_address`,b.`permanent_barangay`,b.`permanent_zipcode`,b.`permanent_telno`,b.`gsis_bp_no`,
                        b.`pagibig_no`,b.`philhealth_no`,b.`agency_emp_no`,b.`tin_no`,b.`wht_code`,b.`bank_account`,b.`date_regular`,b.`date_contractual`,CURRENT_TIMESTAMP(),`get_fullname_woutbadge`(in_createdby),in_attendancename,
				(
                            SELECT
                                SUM(price * quantity) FROM pos_table_transaction WHERE badgenumber = a.badgenumber AND paymentTYPE_id ='1' AND `date` BETWEEN a.gen_date AND a.gen_date  GROUP BY transaction_no
                            ),
                         FORMAT(ROUND(payroll_sss_contribution(b.`salary`),2),2),
                         FORMAT(ROUND(payroll_philhealth_contribution(b.`salary`),2),2),
                         FORMAT(ROUND(payroll_hdmfpagibig_contribution(b.`salary`),2),2),
                         b.payperiod,
                         b.lastname,
                         b.firstname,
                         b.middlename,
                         b.suffix,
			b.w_satworkdingday
		
			
			
                    FROM
                        ess_db.`vw_timerecords` a
                    LEFT JOIN
                        ess_db.`users` b ON
                        b.`badgenumber` = a.`badgenumber`
                    LEFT JOIN
                        ess_db.`tbl_company` c ON
                        c.`company_id` = b.`company_id`
                    LEFT JOIN
                        ess_db.`tbl_position` d ON
                        d.position_id = b.`employee_position`
                    LEFT JOIN
                        ess_db.`tbl_department` e ON
                        e.department_id = a.department_id
                    LEFT JOIN
                        ess_db.`tbl_gender` f ON
                        f.gender_id = b.gender
                    WHERE
                        gen_date BETWEEN in_gen_from  AND in_gen_to
                    AND
                        b.`company_id` = in_company_id
                    AND 
                        b.`payperiod` IN (in_payperiod)
		     AND b.employment_status  ='Active'
                    AND b.employment_type !=6;
			
			
		UPDATE payroll_new_attendance mt
			SET mt.holiday_regular =  new_payroll_get_holiday_regular(in_attendancename,(SELECT badgenumber FROM payroll_new_attendance WHERE attendance_name = in_attendancename  AND badgenumber = mt.badgenumber LIMIT 1), mt.gen_date), 
			holiday_specialnonworking = new_payroll_get_special_nonwork(in_attendancename,(SELECT badgenumber FROM payroll_new_attendance WHERE attendance_name = in_attendancename AND badgenumber = mt.badgenumber LIMIT 1), mt.gen_date)
		WHERE gen_date = mt.gen_date ;
			
		
		
		    --       OVERTIME
                              
					rot_hrs, rot_in, rot_out , rot_reason,
					rot_remarks, rot_status, rot_status_name,
					created_by, created_date , updated_by, updated_date ,attendance_name)
					
			SELECT employee_id, badgenumber, NAME, department_id,
				rot_hrs, rot_in, rot_out , rot_reason,
				rot_remarks, rot_status, rot_status_name,
				created_by, created_date, updated_by, updated_date , in_attendancename
				
			FROM vw_employee_rot
			WHERE rot_status = 1
			AND rot_date BETWEEN  in_gen_from  AND in_gen_to;
			
			
			-- ==================================== OVERTIME  ==================================== 
					rot_gen_date, rot_hrs, rot_in, rot_out , rot_reason,
					rot_remarks, rot_status, rot_status_name, rot_amount,
					created_by, created_date , updated_by, updated_date ,attendance_name)
					
			SELECT employee_id, badgenumber, NAME, department_id, (SELECT department_name FROM tbl_department WHERE department_id = ct.department_id ),
				rot_date, rot_hrs, rot_in, rot_out , rot_reason, 
				rot_remarks, rot_status, rot_status_name, new_payroll_get_ot_pay(rot_hrs,employee_id),
				created_by, CURRENT_TIMESTAMP(), updated_by, updated_date , in_attendancename
				
			FROM vw_employee_rot ct
			WHERE rot_status = 1
			AND rot_date BETWEEN  in_gen_from  AND in_gen_to;
                            
			SELECT id, in_attendancename, badgenumber, loan_type_id, (SELECT loan_name FROM `tbl_payroll_loan_setup` WHERE id = loan_type_id), amount , deductpermonth, CURRENT_TIMESTAMP()
			FROM payroll_employee_loan 
		WHERE STATUS = 1
		AND company_id = in_company_id
		AND (in_gen_from BETWEEN start_date AND end_date)
		OR (in_gen_to BETWEEN start_date AND end_date);
		
		UPDATE payroll_employee_loan SET balance = amount - (SELECT SUM(paid_amount) FROM payroll_genearated_loans WHERE loan_id = payroll_employee_loan.`id`);
		UPDATE payroll_employee_loan SET STATUS = 3 WHERE balance = 0.00;
		
					
		-- UPDATE payroll_employee_loan SET balance = balance - new.paid_amount
                        badgenumber,attendance_name,leave_type,date_from,date_to,total_days,total_restday,total_holiday,totaldays_ofleave,totalhours,attachment,attachment_name,
                        attachment_ext,description,post_date,admin_no,admin_reply,admin_reply_date,STATUS
                        )
                    SELECT 
                        a.employee_id, in_attendancename ,a.leave_type,a.date_from,a.date_to,a.total_days,a.total_restday,a.total_holiday,a.totaldays_ofleave,a.totalhours,
                        a.attachment,a.attachment_name,a.attachment_ext,a.description,a.post_date,a.admin_no,a.admin_reply,a.admin_reply_date,a.status
                    FROM 
                        ess_db.`leave_history` a
                    LEFT JOIN
                        ess_db.`tbl_leavetypes` b ON
                        b.`leave_type_id` = a.`leave_type`
                    LEFT JOIN 
                        ess_db.`users` c ON
                        c.badgenumber = a.employee_id
                    WHERE 
                        a.date_from BETWEEN in_gen_from  AND in_gen_to
                    AND
                        a.status = 'Approved'
                    AND
                        b.`w_or_wo_pay` = 'W/ PAY'
                    AND
                        a.`notification_type` ='1'
                    AND 
                        c.`payperiod` IN (in_payperiod);
                        
                    
                    
			VALUES (in_attendancename, CONCAT_WS(' ',in_gen_from ,'-',in_gen_to) ,in_company_id , in_payperiod,`get_fullname_woutbadge`(in_createdby));
		
		
			VALUES (in_attendancename ,in_company_id , CURRENT_TIMESTAMP(), `get_fullname_woutbadge`(in_createdby), in_gen_from, in_gen_to);
                             
			SELECT badgenumber, in_attendancename, SUM(item_price * item_quantity)
		FROM pos_table_debt
		WHERE date_of_transaction BETWEEN in_gen_from AND in_gen_to
		AND inStatus != 'payed'
		GROUP BY badgenumber ;
		
		-- UPDATE pos_table_debt SET inStatus = 'payed' WHERE date_of_transaction BETWEEN in_gen_from AND in_gen_to; 
                             
                     
	-- 	INSERT INTO ess_db.payroll_yeartodatefigures (
                              
                       
                         
				SELECT 
					m.badgenumber , m.attendance_name, m.department_id, m.group_tag, in_createdby
                                FROM
                                    `payroll_new_attendance` m 
                              WHERE attendance_name = in_attendancename
                              GROUP BY m.badgenumber;
                              
                            SELECT CONCAT_WS(' ', in_attendancename,'Succesfully Fetch') AS message, '1' AS success_message; 
		
		
		
		
		
				
                             
		END IF;
	END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_pos_category` */

