DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_pos_category`(
	IN method VARCHAR(10)
	,IN in_category VARCHAR(50)
	,IN in_category_id INT(20)
	,in in_type varchar(50)
    )
BEGIN
	CASE
			
		WHEN method = 'add' THEN
				pos_table_category
			(
				category
				,type
			)
			VALUES
			(
				in_category
				,in_type
			);
			
		WHEN method = 'update' THEN 
