/* Procedure structure for procedure `sp_pos_check_shift` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_pos_check_shift` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_pos_check_shift`(
		in in_date varchar(150)
	)
BEGIN
	SELECT  DATE_FORMAT(datetime_start,"%b %e, %Y at %H:%i:%S")AS 'Started On' ,shifts,
        	CASE	
        		WHEN datetime_start IS NOT NULL AND datetime_end IS NULL  AND shifts ='first shift'  THEN datetime_start
        		WHEN datetime_start IS NOT NULL AND datetime_end IS NULL  AND shifts ='second shift'  THEN datetime_start
        		WHEN datetime_start IS NOT NULL AND datetime_end IS NULL  AND shifts ='Third Shift'  THEN datetime_start
        		ELSE 'No Login'
        	END AS shift_start_time
        FROM 
        	`pos_table_endoftheday` 
        WHERE
        	DATE = in_date
        ORDER BY datetime_start DESC 
        LIMIT 1;
        
END */$$
DELIMITER ;

