/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_pos_ingredients`(
	in method varchar(150)
	,in in_ingredients_code varchar(150)
	,in in_ing_name varchar(150)
	,in in_quantity int
	,in in_unit_of_measurement varchar(100)
