/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_pos_items`(
	in method varchar(50)
	,in in_item_id int(20)
	,in in_item_name varchar(100)
	,in in_category_id int(20)
	,in in_barcode varchar(100)
