				item_name = in_item_name
				,sales_price = in_sales_price
				,cost_price = in_cost_price
				,description = in_description
			WHERE 	
				item_id = in_item_id;
		WHEN method = 'updateOnlyQty' THEN
			UPDATE 
				pos_table_items
			SET 
				item_name = in_item_name
				,sales_price = in_sales_price
				,cost_price = in_cost_price
				,description = in_description
				,quantity = in_quantity
				,minimum_stock_alert = in_min_stock_alert
			WHERE 	
				item_id = in_item_id;	
			
		end case;
	END */$$
