/* Procedure structure for procedure `sp_pos_items_reference` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_pos_items_reference` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_pos_items_reference`(
	in in_dr varchar(150)
	,IN in_name varchar(150)
	,IN in_quantity int
    )
BEGIN
		dr
		,name
