/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_pos_sales_card`(
	in in_time_in varchar(150)
	,in in_time_out varchar(150)
	,in in_user_id int
    )
BEGIN
	
	SELECT
		(price * quantity)AS 'total'
	FROM
		pos_table_transaction
	WHERE
		void_status <> 'void' AND
		paymentTYPE_id = '1' AND
		transaction_no BETWEEN in_time_in AND in_time_out
	    AND user_id = in_user_id
	    
	ORDER BY transaction_no DESC;
	
END */$$
