/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_pos_shift`(
	IN method VARCHAR(50)
	,IN in_datetime_start VARCHAR(150)
	,IN in_datetime_end VARCHAR(150)
	,IN in_user_id INT(20)
	,IN in_shifts VARCHAR(150)
	,IN in_date VARCHAR(150)
	,IN in_status VARCHAR(150)
	,IN in_system_cash_total DOUBLE
	,IN in_cashier_cash_total DOUBLE
	,IN in_card_total DOUBLE
	,IN in_debt_total double
    )
BEGIN
		CASE
