/* Procedure structure for procedure `sp_request_time_InOut` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_request_time_InOut` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_request_time_InOut`(
				     IN method varchar(10),
				     IN r_time_id INT,
				     IN r_user_id INT,
				     IN r_check_time datetime,
				     IN r_type int,
				     IN r_employee_reason varchar(255),
				     IN r_status int,
				     iN r_destination INT
				 )
BEGIN
	  IF method = 'ADD' THEN	
		INSERT 
			INTO tbl_time_attendance_request(
				request_user_id,
				request_check_time,
				request_type,
				request_employees_reason,
				request_status,
				request_destination,
				created_by,
				created_date
				)
			VALUES(
			       r_user_id,
			       r_check_time,
			       r_type,
			       r_employee_reason,
			       r_status,
			       r_destination,
			       r_user_id,
			       CURRENT_TIMESTAMP()
			       );
			SELECT 'New Record Successfully Added' as message, 'success' as class;
	 ELSEIF 
		method = 'EDIT' THEN
		UPDATE tbl_time_attendance_request 
			SET 
				request_user_id 		= r_user_id,
				request_check_time		= r_check_time,
				request_type			= r_type,
				request_employees_reason	= r_employee_reason,
				request_status			= r_status,
				request_destination		= r_destination,
				updated_by			= r_user_id,
				updated_date			= CURRENT_TIMESTAMP()
			WHERE
				request_time_id = r_time_id;
			SELECT 'Record Successfully Updated' AS message, 'success' AS class;
	 ELSE
		DELETE FROM tbl_time_attendance_request WHERE request_time_id = r_time_id;
		SELECT 'Record Successfully Deleted' AS message, 'success' AS class;
         END IF;
END */$$
DELIMITER ;

