/* Procedure structure for procedure `sp_rot_aed` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_rot_aed` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_rot_aed`(
				     IN method varchar(20),
				     IN in_rot_id INT,
				     IN in_rot_date DATE,
				     IN in_rot_hrs TIME,
				     IN in_rot_in DATETIME,
				     IN in_rot_out DATETIME,
				     IN in_rot_reason VARCHAR(255),
				     IN in_rot_remarks VARCHAR(255),
				     IN in_employee_id INT,
				     IN in_department_id INT,
				     IN in_rot_status INT
				    )
BEGIN
		DECLARE EXIT HANDLER FOR 1062
		BEGIN
			SELECT CONCAT('Request Overtime is Already Exist (',in_rot_date,')') AS message, 'info' AS class;
		END;
		CASE
			WHEN 	method = 'ADD' THEN
							    department_id,
							    rot_date,
							    rot_hrs,
							    rot_in,
							    rot_out,
							    rot_reason,
							    rot_status,
							    created_by,
							    created_date)
					VALUES(in_employee_id,
						in_department_id,
						in_rot_date,
						in_rot_hrs,
						in_rot_in,
						in_rot_out,
						in_rot_reason,
						in_rot_status,
						in_employee_id,
						CURRENT_TIMESTAMP);
						
					SELECT CONCAT('New Request Overtime Successfully Added (',in_rot_date,')') AS message , 'success' AS class;
			WHEN 	method = 'EDIT' THEN
					UPDATE 
						tbl_rot 
					SET
						employee_id	= in_employee_id,
						department_id	= in_department_id,
						rot_date	= in_rot_date,
						rot_hrs		= in_rot_hrs,
						rot_in		= in_rot_in,
						rot_out		= in_rot_out,
						rot_reason	= in_rot_reason,
						rot_remarks 	= in_rot_remarks,
						rot_status 	= in_rot_status,
						updated_by 	= in_employee_id,
						updated_date 	= CURRENT_TIMESTAMP
					WHERE
						rot_id = in_rot_id;
					SELECT CONCAT('Request Overtime Successfully Updated (',in_rot_date,')') AS message , 'success' AS class;
			WHEN 	method = 'REJECT' THEN
					UPDATE 
						tbl_rot 
					SET
						rot_remarks 	= in_rot_remarks,
						rot_status 	= in_rot_status,
						updated_by 	= in_employee_id,
						updated_date 	= CURRENT_TIMESTAMP
					WHERE
						rot_id = in_rot_id;
					SELECT CONCAT('Request Overtime Successfully Rejected (',in_rot_date,')') AS message , 'success' AS class;
			WHEN 	method = 'APPROVE' THEN
					UPDATE 
						tbl_rot 
					SET
						rot_remarks 	= 'Approve',
						rot_status 	= in_rot_status,
						updated_by 	= in_employee_id,
						updated_date 	= CURRENT_TIMESTAMP
					WHERE
						rot_id = in_rot_id;
					SELECT CONCAT('Request Overtime Successfully Approve') AS message , 'success' AS class;
			ELSE
				DELETE FROM tbl_rot WHERE rot_id = in_rot_id;
				SELECT CONCAT('Request Overtime Successfully Deleted (',in_rot_date,')') AS message , 'success' AS class;
		END CASE;
END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_showtimerec_userid` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_showtimerec_userid` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_showtimerec_userid`(IN user_id INT ,IN date_from DATE,IN date_to DATE)
BEGIN
	SELECT employee_id,
	       department_id,
	       gen_date,
	       week_days,
	       schedule_in AS SCHEDULE,
	       DATE_FORMAT(time_in, "%m/%d/%Y %H:%i:%s") AS in_out,
	       CASE
			WHEN  time_in > schedule_in THEN 
			     'red'
			ELSE
			     'green'
		END AS color,
		'IN' as checktime_status
	FROM vw_time_attendance_base_on_schedule
	WHERE 
		employee_id = user_id AND 
		gen_date BETWEEN date_from AND date_to AND 
		time_in IS NOT NULL
	UNION ALL
	SELECT employee_id,
	       department_id,
	       gen_date,
	       week_days,
	       schedule_out,
	       DATE_FORMAT(time_out, "%m/%d/%Y %H:%i:%s") AS in_out,
	       CASE
			WHEN  time_out > schedule_in THEN 
			     'green'
			ELSE
			     'red'
		END,
		'OUT'
	FROM vw_time_attendance_base_on_schedule
	WHERE 
		employee_id = user_id AND 
		gen_date BETWEEN date_from AND date_to AND 
		time_out IS NOT NULL
	ORDER BY gen_date;
END */$$
DELIMITER ;

