						in in_totalhours int,
						in in_attachment longblob,
						in in_attachment_name varchar(50),
						in in_attachment_ext varchar(50)
						)
BEGIN
		
						admin_no,
						employee_id,
						leave_type,
						status,
						date_from,
						date_to,
						description,
						post_date,
						admin_reply,
						isread,
						notification_type,
						total_days,
						total_restday,
						total_holiday,
						totaldays_ofleave,
						totalhours,
						attachment,
						attachment_name,
						attachment_ext  
						)
					   VALUES (
						'Waiting for approval',
						in_employee_id,
						in_leavetype,
						'Pending...',
						in_datefrom,
						in_dateto,
						in_description,
						current_timestamp(),
						'N/a',
						0,
						1,
						in_total_days,
						in_total_restday,
						in_total_holiday,
						in_totaldays_ofleave,
						in_totalhours,
						in_attachment,
						concat_Ws('',in_employee_id,'-',current_timestamp()),
						in_attachment_ext
						);
			SELECT CONCAT_WS(' ',leavetype,'Succesfully Submitted For Approval') AS message FROM ess_db.`tbl_leavetypes`
			WHERE leave_type_id = in_leavetype;
	END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_users_available_leave` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_users_available_leave` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_users_available_leave`(in in_badgenumber varchar(100))
BEGIN
		SELECT
                                    COUNT(*) AS numrows
                                FROM
                                    ess_db.`tbl_user_availableleave` a
                                LEFT JOIN
                                    ess_db.`tbl_leavetypes` b ON
                                    b.leave_type_id = a.leave_type_id
                                LEFT JOIN
                                    ess_db.`users` c ON
                                    c.`badgenumber` = a.`badgenumber`
                                WHERE
                                    a.badgenumber = in_badgenumber
                                AND
                                    b.remove_by IS NULL
                                AND
                                    a.`leave_balance` NOT IN('0')
                                AND
                                    CASE
                                        WHEN c.`gender` ='1' THEN b.`availablefor` IN('3','1')
                                    ELSE
                                        b.`availablefor` IN('3','2')
                                END;
	END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_users_change_pass` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_users_change_pass` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_users_change_pass`(IN method VARCHAR(50),
				           IN inbadgenumber VARCHAR(50),
				           IN inpassword VARCHAR(100))
BEGIN
		IF method = 'UPDATE' THEN 
		
			UPDATE ess_db.users SET PASSWORD = inpassword WHERE badgenumber = inbadgenumber;
		END IF ;
		
		SELECT 'success' AS success_message;
	END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_users_upload_requirements` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_users_upload_requirements` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_users_upload_requirements`(	
							IN method varchar(50),
							IN in_id int,
							in in_employee_id varchar(100),
							in in_document_type_id int,
							in in_document_name varchar(100),
							in in_document_type varchar(100),
							in in_document longblob,
							In in_document_ext varchar(50),
							IN in_date_uploaded DATETIME,
							IN in_status VARCHAR(50),
							IN in_isread INT,
							in in_remove_by	varchar(100),
							in in_remove_date datetime	
							)
BEGIN
		case when method ='ADD' THEN 
									employee_id,
									document_type_id,
									document_name,
									document_type,
									document,
									document_ext,
									date_uploaded,
									status,
									isread 
									)
					VALUES(	in_employee_id,
						in_document_type_id,
						in_document_name,
						in_document_type,
						in_document,
						in_document_ext,
						CURRENT_TIMESTAMP,
						in_status,
						in_isread
						);
						
			SELECT concat_Ws(' ',in_document_name,'Successfully Uploaded ') AS message , 'success' AS class;
			
		when method = 'DELETE' THEN 
			UPDATE ess_db.`users_temp_uploadedfiles` 
                                SET remove_by = in_remove_by,
                                    remove_date = CURRENT_TIMESTAMP
                                WHERE
                                    file_id = in_id;
			SELECT CONCAT_WS(' ',in_document_name,'Successfully Cancelled') AS message , 'success' AS class;
			
			
		end case;
	END */$$
DELIMITER ;

