DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_user_logout`(
					in method varchar(100),
					in in_employee_id varchar(100)
					)
BEGIN
		case
			when method = 'ADD' then 
											ACTION)
					VAlueS (in_employee_id,
					'LOGOUT');
			SELECT CONCAT('New Record Successfully Added ') AS message, 'success' AS class;	
		END CASE;	
	END */$$
