/* Procedure structure for procedure `sp_user_session` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_user_session` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_user_session`(IN userid int)
BEGIN
		SELECT 
			a.*,
			DATE_FORMAT(a.DOB,'%M/%d/%Y') AS DOB,
			DATE_FORMAT(a.date_hire,'%M/%d/%Y')AS date_hire,
			DATE_FORMAT(a.created_on,'%Y, %M') AS Membersince,
			b.gender_name,
			c.civil_status_name,
			d.blood_types_name,
			e.position_name,	
			f.employment_type,
			f.employment_type_id,
			f.employment_type AS employment_type_name,
			g.department_name,
			h.company_name,
			CONCAT_WS(' ',lastname,firstname,middlename,suffix) AS fullname,
	CASE
		WHEN regular IS NULL THEN 'probationary'
		ELSE 'Regular'
		
	END AS employmenttype
		FROM ess_db.`users` a 
		LEFT JOIN ess_db.`tbl_gender` b ON b.gender_id = a.gender
		LEFT JOIN ess_db.`tbl_civil_status` c ON c.civil_status_id = a.civil_status
		LEFT JOIN ess_db.`tbl_blood_types` d ON d.blood_types_id = a.bloodtype
		LEFT JOIN ess_db.`tbl_position` e ON e.position_id = a.employee_position
		LEFT JOIN ess_db.`tbl_employment_type` f ON f.employment_type_id = a.employment_type
		LEFT JOIN ess_db.`tbl_department` g ON g.department_id = a.department_id
		LEFT JOIN ess_db.`tbl_company` h ON h.company_id = a.company_id
		WHERE id= userid;
	END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_work_movements` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_work_movements` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_work_movements`(
						in in_id int,
						in in_action varchar(20),
						in in_badgenumber varchar(50),
						IN in_company INT,
						IN in_area INT,
						IN in_department INT,
						IN in_position INT,
						IN in_employmenttype INT,
						in in_salary decimal(18,2),
						in in_startdate date,
						in in_enddate date,
						in actionby varchar(50)
					)
BEGIN
	
		if in_action = 'ADD' THEN 
	
			
						badgenumber, company_id, area_id, department_id, position_id, employment_type_id, salary, start_date, end_date, update_by)
					 select badgenumber, company_id, area_id, department_id, employee_position, employment_type, in_salary, date_start_work, date_end_work, actionby 
					from users
				where badgenumber = in_badgenumber;
				
				UPDATE users SET 
						company_id = in_company,
						area_id = in_area,
						department_id = in_department,
						employee_position = in_position,
						employment_type = in_employmenttype,
						salary = in_salary,
						date_start_work = in_startdate,
						date_end_work = in_enddate
		
				WHERE badgenumber = in_badgenumber;
				
				SELECT 'success' AS message_success , 'Success' AS message_title, 'Successfully Update Workplace' AS message_body;
		end if;
	END */$$
DELIMITER ;

