/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `vw_announcements` AS select `tbl_announcements`.`id` AS `id`,`tbl_announcements`.`employees` AS `employees`,(select concat_ws(' ',`users`.`lastname`,`users`.`firstname`,`users`.`middlename`,`users`.`suffix`) from `users` where `users`.`badgenumber` = `tbl_announcements`.`badgenumber`) AS `admin_fullname`,group_concat(concat_ws(' ',`users`.`lastname`,`users`.`firstname`,`users`.`middlename`,`users`.`suffix`),' ' separator ',') AS `employees_info`,`tbl_announcements`.`announcement_name` AS `announcement_name`,`tbl_announcements`.`announcement_mess` AS `announcement_mess`,date_format(`tbl_announcements`.`created_date`,'%M-%Y-%d %h:%i:%s %p') AS `date_created` from (`tbl_announcements` join `users` on(find_in_set(`users`.`badgenumber`,`tbl_announcements`.`employees`) > 0 or find_in_set(`users`.`badgenumber`,`tbl_announcements`.`employees`) is null)) where `tbl_announcements`.`type` = '0' group by `tbl_announcements`.`id` desc */;

/*View structure for view vw_awol */

/*!50001 DROP TABLE IF EXISTS `vw_awol` */;
/*!50001 DROP VIEW IF EXISTS `vw_awol` */;

/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `vw_awol` AS (select `b`.`badgenumber` AS `badgenumber`,concat_ws(' ',`b`.`badgenumber`,'-',`a`.`lastname`,`a`.`firstname`,`a`.`middlename`,`a`.`suffix`) AS `empname`,`a`.`photo` AS `photo`,`c`.`department_name` AS `department_name`,(select case when count(0) = 0 then 'No Written Warning' when count(0) = 1 and date_format(current_timestamp(),'%H:%i:%s') > '12:01:00' then 'Ready For 3 Days Suspension' when count(0) = 2 and date_format(current_timestamp(),'%H:%i:%s') > '12:01:00' then 'Ready For 7 Days Suspension' when count(0) >= 3 and date_format(current_timestamp(),'%H:%i:%s') > '12:01:00' then 'Ready For Dismissal' end from `ess_db`.`tbl_users_suspended` where `ess_db`.`tbl_users_suspended`.`employee_id` = `b`.`badgenumber` and `ess_db`.`tbl_users_suspended`.`memo_name` in ('written warning awol','3 Days Suspension Memo awol','7 Days Suspension Memo awol')) AS `have_memo`,case when date_format(current_timestamp(),'%H:%i:%s') <= '11:59:00' then 'Waiting Until 12:00 for Reason of sickness' else 'Failed To Notify Office' end AS `todaytime`,case when date_format(current_timestamp(),'%H:%i:%s') >= '12:01:00' then 'yes_passed' else 'not_passed' end AS `todaytime2`,if(`get_awol_status`(`b`.`badgenumber`,`b`.`gen_date`,`b`.`absent_status`) = 'absent' and (select `get_awol_status`(`a`.`badgenumber`,`a`.`gen_date`,`a`.`absent_status`) from `ess_db`.`vw_timerecords` `a` where `a`.`badgenumber` = `b`.`badgenumber` and `a`.`gen_date` between if(date_format(`b`.`gen_date`,'%Y-%m-%d') = date_format(`b`.`gen_date`,'%Y-%m-%01'),`b`.`gen_date`,`b`.`gen_date` - interval 1 day) and `b`.`gen_date` limit 1) = 'absent','awol','not_awol') AS `awol_notice` from ((`ess_db`.`vw_timerecords` `b` left join `ess_db`.`users` `a` on(`a`.`badgenumber` = `b`.`badgenumber`)) left join `ess_db`.`tbl_department` `c` on(`b`.`department_id` = `c`.`department_id`)) where `b`.`rd_status` = '0' and `b`.`suspended_status` = '0' and if(`get_awol_status`(`b`.`badgenumber`,`b`.`gen_date`,`b`.`absent_status`) = 'absent' and (select `get_awol_status`(`a`.`badgenumber`,`a`.`gen_date`,`a`.`absent_status`) from `ess_db`.`vw_timerecords` `a` where `a`.`badgenumber` = `b`.`badgenumber` and `a`.`gen_date` between if(date_format(`b`.`gen_date`,'%Y-%m-%d') = date_format(`b`.`gen_date`,'%Y-%m-%01'),`b`.`gen_date`,`b`.`gen_date` - interval 1 day) and `b`.`gen_date` limit 1) = 'absent','1','0') = 1 and `b`.`gen_date` between curdate() and curdate()) */;

