insert  into `tbl_announcements`(`id`,`badgenumber`,`employees`,`announcement_name`,`announcement_mess`,`type`,`created_date`,`update_date`,`update_by`,`remove_by`,`remove_date`) values 
(1,'029298813',NULL,'Announce a Budget Surplus - Letters','<p>We are pleased to announce that for the first time in ten years, Doe University has a budget surplus. Within the month, deans and department chairs will receive notification of amounts available for their use. Although the funds are unrestricted, we encourage administrators to use them for partial tuition scholarships for deserving students. This is one way we can ease the burden of many and shorten the time required to complete their studies.</p>\r\n',0,'2020-03-03 16:46:08',NULL,NULL,NULL,NULL),
(2,'029298813','000101010,000202020','Announce a Change In Policy or Fee Amount - Letters','<p>Because of a surprising rise in the cost of materials, we have tentatively raised prices on our entire stock. The change is effective immediately, but we hope it will be temporary.</p>\r\n\r\n<p>You will still receive the same quality Doe merchandise, and we will still keep our commitment to next-day delivery. Early indications suggest that when the volatile market settles, we will be able to return to an earlier pricing schedule.</p>\r\n\r\n<p>We appreciate your business and look forward to hearing from you again. We appreciate you as a loyal costumer as we weather the inflation storm.</p>\r\n',0,'2020-03-03 16:47:37',NULL,NULL,NULL,NULL),
(3,'029298813',NULL,'Sample letter of announcement','<p>To Whom It May Concern:</p>\r\n\r\n<p>Grecian Furnishings is proud to announce the beginning of their monthly furniture sale!</p>\r\n\r\n<p>Starting on November 1st, 2009, everything in our showroom will be marked down at least 50%! Nowhere else in town will you find better deals on the greatest chairs, sofas, recliners, and other household furnishings.</p>\r\n\r\n<p>Come visit us on November 14th&nbsp;for a special barbeque and live concert in the morning. On that day, receive an additional 10% off everything in our store.</p>\r\n\r\n<p>Our entire inventory must go! Come visit us a 345 Greenlawn Road, Lousiville, and pick up some great furniture at unbeatable prices!</p>\r\n\r\n<p>Sincerely,</p>\r\n\r\n<p>Grecian Furniture</p>\r\n',0,'2020-03-31 10:55:26',NULL,NULL,NULL,NULL),
(4,'029298813',NULL,'Meeting ni abance','<p>ngaun pumunta kau sa heead office</p>\r\n',0,'2020-07-01 18:31:25',NULL,NULL,NULL,NULL),
(5,'029298813',NULL,'Wala lang ito','<p>wag nyo lang pansinin</p>\r\n',0,'2021-03-22 16:40:15',NULL,NULL,NULL,NULL);
